(1429, 1429, 'The electrifying conclusion to Raymond E. Feist\'s epic story! The only thing standing between Crydee and complete destruction is Princess Carline. Can she save Midkemia?'),
(1430, 1430, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
