(1432, 1432, 'Containing:\\r\\nHALO: UPRISING #3\\r\\nHALO: UPRISING #4\\r\\n72 PGS./17 & Up ...$5.99 \\r\\n\\u00a92009 Microsoft Corporation. All rights reserved.\\r\\nMicrosoft; Halo; the Halo logo; the Microsoft Game Studios logo; Xbox; Xbox 360; Xbox Live;\\r\\nand the Xbox logos are trademarks of the Microsoft group of companies. \\r\\nBungie and the Bungie logo are trademarks or registered trademarks of Bungie; LLC.'),
(1433, 1433, 'In 2003; Dabel Brothers Productions released THE HEDGE KNIGHT and stunned the comic book world with their high quality adaptation of New York Times Best-Selling author George R. R. Martin\'s novella which serves as a prequel to his epic novel series; A SONG OF ICE AND FIRE. In 2004; the collected graphic novel edition of THE HEDGE KNIGHT went on to become one of the best-selling graphic novels of the year. In 2006; Marvel Comics and Dabel Brothers Production republished the book in a prestige hardcover format; much to the delight of collectors and critics alike. And in Spring 2007; the Dabel Brothers will continue the story of THE HEDGE KNIGHT by adapting the next chapter in the series: George R. R. Martin\'s THE SWORN SWORD.\\r<br>Featuring the return of the creative duo of Mike S. Miller and Ben Avery; THE SWORN SWORD tells the story of the adventures of Ser Duncan and his squire one year after their initial meeting at the tournament in Ashford. After traveling the land in search of the'),
(1434, 1434, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1435, 1435, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1436, 1436, 'The frighteningly funky and fearsome Freak returns; more powerful than ever! And this action-packed issue features the \\r<br>gorgeous art of Barry Kitson - fresh from Marvel\'s THE ORDER!  Plus: Menace! Curt Connors!  Aunt May!  Lots of innocent bystanders!  Gale wrote it; Wacker edited it; and Marvel actually thought it was a good idea to publish it!\\r<br>Rated A ...$2.99 \\r<br>'),
(1437, 1437, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1438, 1438, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1439, 1439, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
