(1441, 1441, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1442, 1442, 'Bruce Banner is the Hulk once again; and far from being left alone; he\'s got a whole family of gamma-charged allies at his side. Son Skaar; daughter Lyra; cousin She-Hulk; friends A-Bomb and Korg; and wife Red She-Hulk or is that EX-wife? Meanwhile; a universe away; Hiro-Kala; the mysterious DARK SON of Hulk; rises to power on the planer K\'ai. He has a plan for his long lost family members; and it involves a bigger smash than his father has ever made. Collecting INCREDIBLE HULKS #612-617.'),
(1443, 1443, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1444, 1444, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1445, 1445, 'The body count rises higher than ever as the X-Men and their allies face war on every front! The original X-Men have formed X-Factor; and they come up against their deadliest challenge yet in Apocalypse and his Horsemen; including the all-new Archangel! The New Mutants lose one of their own! And after the Marauders slaughter the Morlocks; they take on the X-Men - and the survivors will be asked to sacrifice themselves to stop the evil Adversary! Featuring tie-ins starring Captain America; Daredevil; the Hulk; the Fantastic Four and Power Pack! Collecting NEW MUTANTS (1983) #55-61; UNCANNY X-MEN #220-227; X-FACTOR (1986) #18-26; CAPTAIN AMERICA (1968) #339; DAREDEVIL (1964) #252; FANTASTIC FOUR (1961) #312; INCREDIBLE HULK (1968) #336-337 & #340 and POWER PACK (1984) #35.'),
(1446, 1446, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1447, 1447, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1448, 1448, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1449, 1449, 'The siege of Crydee! As the massive Tsurani force descends on the castle; it is seemingly only a matter of time before the walls that have safeguarded Crydee fall. Can Prince Arutha save his people in time?'),
(1450, 1450, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1451, 1451, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1452, 1452, 'The epic; untold love story between Marvel\'s two pre-eminent Black super heroes -- Storm and the Black Panther -- is finally told; as only New York Times best-selling author Eric Jerome Dickey can do it!  An orphaned street urchin; living by her wits on the unforgiving plains of Africa as she struggles to harness her slowly-developing mutant powers...A warrior Prince; embarking on his rite of passage as he ponders the great responsibility in his future...And a crew of ruthless mercenaries who\'ll stop at nothing to capture an elusive creature of legend -- the fabled wind-rider.  What sparks occur when their paths intersect?  Don\'t miss out on this story; True Believer; as it builds to a July Event that will shake the entire Marvel Universe.\\r<br>\\r<br>32 PGS./T+ SUGGESTED FOR TEENS AND UP ...$2.99\\r<br>'),
(1453, 1453, '\\Re-live the legendary first journey into the dystopian future of 2013 - where Sentinels stalk the Earth'),
(1454, 1454, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1455, 1455, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1456, 1456, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1457, 1457, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1458, 1458, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1459, 1459, 'The deadly super flu Captain Trips has devastated the country and now the few survivors must pick up the pieces and go on. Larry Underwood seeks escape from New York City. Lloyd contemplates an extremely unsavory dinner option in jail; and Stu Redman makes a desperate bid for freedom from his interrogators. Most ominous of all; the stange being called Randall Flagg continues his dread journey across the devastated landscape of America. You must not miss it! Collecting THE STAND: AMERICAN NIGHTMARE #1-5.\\r\\nParental Advisory ...$24.99 \\r\\nISBN: 978-0-7851-3621-7\\r\\nTrim size: standard'),
(1460, 1460, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1461, 1461, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1462, 1462, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1463, 1463, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1464, 1464, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1465, 1465, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1466, 1466, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1467, 1467, 'Of the original trio; Roland is the only one who remains in Crydee. Tomas finds himself in Elvandar; falling deeper under the control of his enchanted armor. Pug; in the land of the Tsurani; encounters the Great Ones.'),
(1468, 1468, 'Heavy-hitting heroes unite! This Official Handbook contains in-depth bios on more than 30 of the Marvel Universe\'s most awesome assemblages - including the Defenders; Power Pack and the New Thunderbolts! Plus: An all-new cover by superstar artist Tom Grummett; digitally painted by Morry Hollowell.\\r<br>48 PGS./All Ages ...$3.99\\r<br>'),
(1469, 1469, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1470, 1470, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1471, 1471, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1472, 1472, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1473, 1473, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1474, 1474, 'After picking fights with the Juggernaut; Norman Osborn; and the Wolverine clan; the most insane father and son team in the Marvel Universe might actually be bonding.  But everything\'s about to blow wide open for Bruce Banner and his big; green; barbarian son Skaar when one of the Hulk\'s greatest enemies brings back the most important villainess Bruce Banner\'s ever faced.  Who is the Harpy?  And whose side will Banner take when she and Skaar meet sword to claw in a gamma-powered deathmatch?  Stone might bleed; feathers might fly; and hearts might break in the highest stakes battle yet for Banner and Son! Plus; The Savage SHE-HULK continues her quest to find\\r\\nJennifer Walters in a back-up by Fred Van Lente and\\r\\nMichael Ryan!\\r\\nRated A ...$3.99'),
(1475, 1475, 'Collecting the first six art books of Marvel\'s REFLECTIONS series from multiple Eisner Award-nominated creator David Mack; this gorgeous volume of cover paintings and step-by-step art techniques is being presented in oversized hardcover format to show off Mack\'s work to full effect. Readers have been waiting for an oversized art-book collection of Mack\'s work for years; and this monster volume delivers with loads of extras -- including never-before-seen art; new paintings; a cover gallery; figure studies; step-by-step art techniques and commentary; remastered pages; new design pages; a \\Best of Letters\\\" section'),
(1476, 1476, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1477, 1477, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1478, 1478, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1479, 1479, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1480, 1480, 'Collecting the groundbreaking first year of Ultimate Spider-Man in one colossal trade paperback! High school; puberty; first dances - there are many pitfalls to being young. Compound these with intense personal tragedy and super human powers; and you can start to visualize the world of Peter Parker; a.k.a. Spider-Man. Following the murder of his uncle and the Green Goblin\'s assault on his high school; Peter finds himself on the brink of manhood: getting a job at the Daily Bugle to help support his widowed aunt and taking on extracurricular activities - such as bringing down the Kingpin; the head of organized crime in New York City! Collecting ULTIMATE SPIDER-MAN #1-13.\\r\\n352 PGS./Rated A ...$24.99'),
(1481, 1481, 'On the mean streets of the Marvel Universe; the kid gloves come off. Guardian devils; vengeance-seeking vigilantes and enigmatic assassins stalk the city\'s dark underbelly _ and the urban action unfolds with gritty intensity. The newest entry in Marvel\'s best-selling Handbook series; OHOTMUMK04 includes in-depth bios on a host of the House\'s edgiest icons - from Black Panther to Shang-Chi!'),
