(1498, 1498, 'The War between the Tsurani and the people of Midkemia rages on. Tomas has fled to the mountains to assist the dwarves but his enchanted armor seems to be exercising increasing control over him. Will the armor fully consume him?'),
(1499, 1499, 'The Ultimates vs. the Ultimate X-Men: the battle begins. When the X-Men do the worst thing they could to humanity; the government orders Captain America; Iron Man; Thor and the rest of the Ultimates to bring them down. A small but lethal army; the Ultimates were created to face these and other newly rising threats to mankind. But the X-Men\'s founder; Professor X; hasn\'t been training his students for nothing -- and the youngs mutants just might take out the Ultimates first.'),
(1500, 1500, 'The landscape of the Marvel Universe is changing; and it\'s time to choose: Whose side are you on? A conflict has been brewing from more than a year; threatening to pit friend against friend; brother against brother - and all it will take is a single misstep to cost thousands their lives and ignite the fuse! As the war claims its first victims; no one is safe as teams; friendships and families begin to fall apart. The crossover that rewrites the rules; Civil War stars Spider-Man; the New Avengers; the Fantastic Four; the X-Men and the entirety of the Marvel pantheon! Collecting CIVIL WAR #1-7; MARVEL SPOTLIGHT: CIVIL WAR and CIVIL WAR SCRIPT BOOK.\\r<br>Rated T+ ...$39.99\\r<br>ISBN: 978-0-7851-2178-7\\r<br>Trim size: oversized\\r<br>'),
(1501, 1501, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1502, 1502, 'Size does matter.  And no one knows this more than Hank Pym - a.k.a. Ant-Man. Got a problem with Galactus? Call the FF. Got a problem with; say; mind-controlled cockroaches? Then Ant-Man\'s your man! And needless to say; it\'s done a number on our diminutive hero\'s self-esteem.  When Ant-Man is tapped to infiltrate an international spy ring that has been siphoning secrets out of Washington; he jumps at the chance - unaware that he\'s being used as a pawn in a larger game of espionage.\\r\\n32 PGS./PARENTAL ADVISORY...$2.99'),
