(1508, 1508, 'The spectacular sequel to last year\'s OFFICIAL HANDBOOK OF THE MARVEL UNIVERSE: SPIDER-MAN 2004; this Official Handbook contains in-depth bios on more than 30 of the wisecracking web-slinger\'s closest allies and most infamous enemies - including the Stacy Twins; fresh from the pages of AMAZING SPIDER-MAN; and Toxin; in time for this month\'s TOXIN #1! Plus: An all-new cover by superstar artist Tom Raney; digitally painted by Morry Hollowell.\\r<br>48 PGS./Marvel PSR ...$3.99\\r<br>'),
(1509, 1509, 'Ant-Man digs deeper into finding out who is leaking those dirty little secrets that are threatening our national security. And who\'s better at uncovering dirty LITTLE secrets than him??'),
(1510, 1510, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(1511, 1511, 'Writer J.M. DeMatteis and artist Mike Zeck craft the ultimate tale of revenge in this groundbreaking and legendary collection! Kraven the Hunter has stalked and killed every animal known to man. But there is one beast that has eluded him. One quarry that has mocked him at every turn: the wall-crawling web-slinger known as Spider-Man. And to prove that he is the hero\'s master; he will pull on his costume and become him...after he shoots and buries him six feet under! Collecting WEB OF SPIDER-MAN #32-33;\\r<br>AMAZING SPIDER-MAN #393-394 and SPECTACULAR\\r<br>SPIDER-MAN #131-132.\\r<br>Rated T+ ...$14.99\\r<br>ISBN: 978-0-7851-3450-3\\r<br>'),
