(2244, 2244, 'The Infinity Comics edition of SHE-HULK (2014) #1 by Charles Soule and Javier Pulido! Jennifer Walters is the She-Hulk! A stalwart Avenger; valued member of the Fantastic Four; savior of the world on more than one occasion; she\'s also a killer attorney with a pile of degrees and professional respect. A 7-foot-tall drink of cool; emerald water; she\'s tough enough to knock out Galactus with one punch (possibly?) and has a heart bigger than the moon. But juggling cases and kicking bad guy butt is starting to be a little more complicated than she anticipated...'),
(2245, 2245, 'The Infinity Comics edition of SHE-HULK (2014) #1 by Charles Soule and Javier Pulido! With a new practice; a new paralegal and a mounting number of Super Villains she\'s racking up as personal enemies; She-Hulk might have bitten off a little more than she can chew\\u2026but she just calls that Tuesday.'),
(2246, 2246, 'The Infinity Comics edition of SHE-HULK (2014) #2 by Charles Soule and Javier Pulido! Jennifer opens her own practice; but things aren\'t going as smoothly as she\'d like.'),
(2247, 2247, 'The Infinity Comics edition of SHE-HULK (2014) #2 by Charles Soule and Javier Pulido! A new client rides into town but is he hero or villain? Guest-starring Patsy Walker; Hellcat!'),
(2248, 2248, 'The Infinity Comics edition of SHE-HULK (2014) #3 by Charles Soule and Javier Pulido! We the people find you DOOM! When the son of Victor Von Doom seeks extradition; Jen Walters will go to the ends of the earth for justice!'),
(2249, 2249, 'The Infinity Comics edition of SHE-HULK (2014) #3 by Charles Soule and Javier Pulido! Guest-starring Matt Murdock; AKA Daredevil!'),
(2250, 2250, 'The Infinity Comics edition of SHE-HULK (2014) #4 by Charles Soule and Javier Pulido! Jen\'s new client Kristoff Vernard has been kidnapped by his dad; Doctor Doom!'),
(2251, 2251, 'The Infinity Comics edition of SHE-HULK (2014) #4 by Charles Soule and Javier Pulido! What does fellow lawyer (and recently outed Man Without Fear) Matt Murdock know about it? It\'s an international jailbreak; She-Hulk style!'),
(2252, 2252, 'The Infinity Comics edition of SHE-HULK (2014) #5 by Charles Soule and Ron Wimberly! She-Hulk and Hellcat must uncover the secrets of the Blue File\\u2060\\u2014a conspiracy that touches the entire Marvel Universe!'),
(2253, 2253, 'The Infinity Comics edition of SHE-HULK (2014) #5 by Charles Soule and Ron Wimberly! This new mystery brings us She-Hulk\'s most terrifying role ever: Defendant!'),
(2254, 2254, 'The Infinity Comics edition of SHE-HULK (2014) #6 by Charles Soule and Ron Wimberly! Someone important to She-Hulk was killed\\u2014and she won\'t let it stand.'),
