(2782, 2782, 'Collects X-Force (2019) #18-19; Children of the Atom (2021) #2; New Mutants (2019) #16-17; Cable (2020) #9.  Dark secrets in the Reign of X! Quentin Quire returns to Krakoa to find a nightmare creature wreaking havoc on his teammates. The only way to battle it is on its own turf. Sweet dreams; Quentin! But what is X-Force hiding? Elsewhere; a local prison riot quickly turns into an escape - and the only ones who can stop it are\\u2026a bunch of high schoolers?! The Children of the Atom are on the case! The New Mutants have begun a wild hunt - but someone is looking for friends in all the wrong places; someone else is missing without a trace\\u2026and plans that have long been in motion are beginning to unfurl! Meanwhile; Cable\'s future is coming back to haunt him\\u2026and he isn\'t ready. Yet.'),
