(2820, 2820, 'Collects Spectacular Spider-Man (1976) #43-55; Annual (1979) #2.  Before he would set AMAZING SPIDER-MAN on the path to comics glory; master storyteller Roger Stern did a spectacular job on Spidey\'s sister title! Producing a run of the wall-crawler\'s most memorable tales; Stern introduced a host of new and compelling characters - including the gangster Belladonna and a new love interest for Aunt May; Nathan Lubensky - and reinvigorated the Prowler and White Tiger. But don\'t worry; Stern left room to spare for iconic enemies! The Vulture returns - and he\'s brought his evil nephew Malachi with him! And another veteran of the Sinister Six; Mysterio; is up to no good; in league with a gang of Spider-Man\'s oldest villains! This Masterworks volume also includes a double-sized showdown with the man called Rapier!'),
