(2824, 2824, 'Collects Marvel 2-in-One (2017) #1-12; Marvel 2-in-One Annual (2018) #1.  With their family torn apart; the Thing and the Human Torch are the Fantastic Two! The world mourns Reed and Sue Richards; missing and presumed dead. Meanwhile; something is wrong with Johnny Storm; and only Ben Grimm can help him! But what monumental secret has Doctor Doom been hiding - and how will it completely change Ben and Johnny\'s lives?! Things go multiversal as the Thing and the Torch look for answers to their family tragedy on other worlds - but they\'ll end up powerless and lost; fighting to survive in a savage wasteland! The Thing allies himself with an old enemy in brand-new armor - and get ready for the two-in-one team-up that everybody has been waiting for! But will Ben and Johnny discover the true fate of the Four?'),
(2825, 2825, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(2826, 2826, 'Collects Star Wars: War of the Bounty Hunters - Jabba the Hutt (2021) #1; Star Wars: War of the Bounty Hunters - 4-LOM & Zuckuss (2021) #1; Star Wars: War of the Bounty Hunters - Boushh (2021) #1; Star Wars: War of the Bounty Hunters - IG-88 (2021) #1.  You will never find a more wretched collection of scum and villainy! As Boba Fett\\u2019s simple mission to deliver the carbonite-frozen Han Solo and collect his payday erupts into chaos and the War of the Bounty Hunters engulfs the galaxy; fan-favorites from the darker side of the Star Wars universe get their chances to shine! Failed by his most trusted bounty hunter; Jabba the Hutt hires a bounty hunter from the High Republic \\u2013 Deva Lompop! The team supreme is divided as 4-LOM battles Zuckuss \\u2014 but what could tear them apart? The secret origin of Boushh is revealed as the legendary warrior is hired to assassinate Domina Tagge! And the homicidal droid IG-88 explodes into action!'),
