(3028, 3028, 'Collects Amazing Spider-Man #797-801. The epic conclusion to Dan Slott\\u2019s amazing; record-breaking run! Norman Osborn has been scouring the globe for a cure to the genetic tampering that prevents him from becoming the Green Goblin \\u2014 and at long last; he\\u2019s about to find it! His new weapon? The Carnage symbiote! And Green Goblin plus Carnage equals\\u2026the Red Goblin! When Osborn strikes; who lives? Who dies? And what scars will Spider-Man bear from here on out? Experience one of the most exciting stories in Spidey lore; culminating in a cataclysmic finale that sees the wall-crawler and some of his staunchest \\u2014 and most surprising \\u2014 allies in a no-holds-barred face-off with his most terrifying foe\\u2026ever! Plus; Dan Slott signs off with an emotional; heartfelt final Spidey tale that no fan will want to miss!'),
(3029, 3029, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3030, 3030, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3031, 3031, 'For years; Tyrone Johnson and Tandy Bowen waged a citywide war on drugs; organized crime and corporate greed as the inseparable duo Cloak and Dagger! Now; though; they have drifted apart \\u2013 until a dangerous threat from their past resurfaces; forcing them to reunite and face their feelings! But there\\u2019s a greater danger to their relationship than any villain: mistrust. And things don\\u2019t get any better when Dagger begins investigating a series of murders; with victims who look like they\\u2019ve had the life sucked out of them. Ty must push his powers to the absolute limit to save hundreds of lives; while Tandy discovers the key to defeating their long-lost foe; the Gray! But it may come too late to save Cloak from being lost to the darkness forever\\u2026'),
(3032, 3032, 'Collects Amazing Spider-Man (1963) #203-212; Annual (1964) #14. Peter Parker has always had the worst luck; but Spider-Man is a hit with the ladies in his latest round of adventures! The Black Cat is back; and her love/hate relationship with Spidey is heating up! Dazzler disco-dances with our hero in an early appearance not to be missed! But she\\u2019s not the only mutant caught in Spidey\\u2019s web as Mesmero returns \\u2014 courtesy of writer Dennis O\\u2019Neil! And Spidey history is made with the debut of an all-time-great Spider-Man artist: John Romita Jr.! JRJR carries on the family tradition; creating some of the most iconic Spider-Man adventures of all time \\u2014 beginning right here! Also featuring a Stern \\u2019n\\u2019 Byrne oneshot; the first appearances of Madame Web and Hydro-Man; and Frank Miller\\u2019s classic Spider-Man/Doctor Strange team-up!'),
(3033, 3033, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3034, 3034, 'Spider-Man and Spider-Gwen figure out the meaning of teamwork when the Rhino pulls off a diamond heist! Can they stop his rampage before it\\u2019s too late? Peter Parker takes to the skies as he tries to find out who is stealing technology from cargo planes! And everyone\\u2019s favorite web-slinger gets some help from Spider-Girl when the Green Goblin sets his sights on destroying a historic theater; but can they figure out why he even wants the building demolished? Also featuring action-packed stories with Doc Ock; Kraven the Hunter and Venom!'),
(3035, 3035, 'Collects Star Wars (2015) #50-55 and Star Wars Annual (2015) #4. A New Hope led here! A secret rebel base. A secret rebel fleet. A chance of victory\\u2026but now; Darth Vader has found it. There is no escape. The Empire first strikes back here and now! Can the Millennium Falcon stand alone against the entire Imperial Fleet? Not to mention a TIE Advanced Starfighter with a certain Sith Lord as its pilot?! As the rebels\' plans crumble; Princess Leia must discover the cause of this disaster \\u2014 before it\'s too late! Her mission leads her aboard Darth Vader\'s personal Dreadnought\\u2026but he always seems to know when his enemies are near. If the Rebellion is to live on; sacrifice is needed\\u2026but if hope dies; what survives? Plus: Luke Skywalker and smuggler Sana Starros attend a high-stakes podracing event\\u2026but why? Place your bets!'),
(3036, 3036, 'Last issue ended with Squirrel Girl and someone CLAIMING to be Iron Man getting into a fight! Will this issue show you how that fight goes and who wins and why? THE ANSWER: yes! But with an Iron Man imposter on the scene; that means the real Tony Stark is missing! It\\u2019s up to Squirrel Girl and her friends to find Tony before it\\u2019s too late: for him AND the world. Unfortunately for Squirrel Girl\\u2014as this comic is within the super-hero genre of sequential art; one that relies on high-stakes narrative storytelling filled with twists and turns that result in the world never being the same\\u2014what she finds is not what she expects and the world will never be the same! All this\\u2014plus: let\\u2019s say underwater adventure too awaits you in this issue of the Unbeatable Squirrel Girl!'),
(3037, 3037, 'WEAPONS OF SELF-DESTRUCTION! Two roads diverged in a blood-soaked wood. For a time; Sabretooth took the one less traveled. In this issue; he pays for it. Everything changes here.'),
(3038, 3038, 'The X-Men have battled valiantly against their powerful psychic foe; Cassandra Nova; since the moment she framed Jean Grey for murder on the world stage. They have been hunted. They have been hated. And now\\u2026they can fight no more.'),
(3039, 3039, 'Collects Gambit (1999) #12-25 and Annual 2000. The Cajun rages on! Join Gambit on a time-tossed trip to the 19th century; and discover how the Thieves Guild was shaped by Candra\\u2026and Mr. Sinister! Back in the present; Remy needs help \\u2014 and Rogue flies to his aid! Thanks to Gambit\'s evolving powers; he can finally greet her with a kiss \\u2014 but as his abilities get more unstable; any thoughts of romance will be short-lived. Gambit\'s destiny looms as he takes leadership of the Guild \\u2014 assuming he can survive an Assassination Game against deadly villains like Bullseye; Constrictor; Zaran; Deadpool\\u2026and Archangel? And what are X-Cutioner and Ego the Living Planet doing here?! Gambit will finally discover the secret of his mysterious patron; the New Son \\u2014 but is he hero or villain; and what will Gambit have to sacrifice to triumph?'),
(3040, 3040, 'Collects X-Force/Cable: Messiah War; Cable (2008) #13-25; X-Force (2008) #14-16 And X-Men: Hope. The birth of a single mutant child changed the landscape of the X-Men\\u2019s world. Some saw the baby as mutantkind\\u2019s last hope; others as its doom. Cable took the girl into the future; believing he could save both \\u201cHope\\u201d and their entire species. But Lucas Bishop has wreaked havoc across time and space trying to hunt them down. Now Cyclops sends X-Force into the future to help Cable and Hope \\u2014 and the Messiah War begins! Can a weakened Cable triumph over Bishop; Stryfe and Apocalypse; raise Hope to adulthood and bring her home? And what happens when Hope\\u2019s mutant powers manifest? Cable and Hope\\u2019s survival skills will be put to the test like never before\\u2026and the fate of mutantkind rests on their shoulders!'),
(3041, 3041, 'Collects Punisher (2000) #1-12; Punisher (2001) #1-5 and Punisher Kills the Marvel Universe. critically acclaimed creators that brought you Preacher restore one of Marvel\\u2019s most popular characters to ultraviolent glory \\u2014 as a one-man army; locked; loaded and ready to take out anyone in his way. And Frank starts with Ma Gnucci and her entire crime family! Spacker Dave; Joan the Mouse and Mr. Bumpo all await in one of the most celebrated Punisher stories ever told! And Frank\\u2019s war on crime continues as he targets disgraced General Kreigkopf; and has a very unique team-up with Spider-Man! Plus; in Ennis\\u2019 very first Punisher story; watch as Frank Castle unleashes his fury on the entire Marvel Universe!'),
(3042, 3042, 'Collects Punisher (1986) #1-5; Punisher (1987) #1-10; Daredevil (1964) #257 And Marvel Graphic Novel: Punisher \\u2014 Assassin\\u2019s Guild. The Punisher goes solo! After years making life complicated for Spider-Man; Daredevil and more; the Marvel Universe\\u2019s deadliest vigilante fires his way into his own series \\u2014 beginning behind bars! Find out exactly who Frank Castle is as he makes his way back out of prison \\u2014 and renews his bloody war on crime! Gangsters; drug dealers and other lowlifes beware! These are the formative solo adventures that defined the world of the Punisher \\u2014 establishing his alliance with Microchip; rivalry with Jigsaw and more! From taking on terrorists to massacring the mob to attacking an assassins guild; the Punisher\\u2019s mission never ends \\u2014 but when he crosses paths with the Man Without Fear; will their renewed grudge match turn deadly?'),
(3043, 3043, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3044, 3044, 'A SPIDER-GEDDON TIE-IN! It\\u2019s the end of the road for Peter Parker. Morlun has returned and Peter\\u2019s only ally; J. Jonah Jameson; is doing his best\\u2026but can it possibly be enough?'),
(3045, 3045, 'A DOUBLE-SIZED Marvel Digital Original you don\'t want to miss!\\nOLD WEAPONS\\nSomeone wants the Daughters of the Dragon and they\'re sending the most dangerous HYDRA creation; a man named Winner Rutherford; after Misty and Colleen. Nick Fury; formerly of S.H.I.E.L.D.; wants to get at Winner so he\'s teaming up with Misty and Colleen and...becoming a...Daughter of the Dragon? Anyway; things get deadly fast and Winner is far more dangerous than Misty and Colleen have been led to believe.'),
(3046, 3046, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3047, 3047, 'Collects Giant-Size Ms. Marvel #1; Ms. Marvel (2006) #1-17; Ms. Marvel Special #1. In the \\House of M\\\" universe'),
(3048, 3048, 'Collects New Mutants (1983) #18-20; X-Force (1991) #99 material from X-Force (2008) #7-10. The visionary talents of writer Chris Claremont and legendary illustrator Bill Sienkiewicz bring the Demon Bear that has haunted Danielle Moonstar\\u2019s dreams to horrifying life! It took her parents; and now it has returned for Dani \\u2014 and only the combined efforts of her fellow New Mutants can stop it from finishing the job! Sink your teeth into a true classic! Then; Dani\\u2019s nightmare returns years later as San Francisco \\u2014 and her new team X-Force; come under attack from a similarly unholy ursine!'),
(3049, 3049, 'Collects Wolverine (1988) #150-158; Annual \'99; Wolverine: Origin #1-6. Origins and obligations! When Wolverine\'s adopted daughter Amiko finds herself in the middle of a blood feud; Logan must return to Japan! He\'ll lay his life on the line for hers in a saga involving the Silver Samurai and the Clan Yashida! Then; Wolverine and Deadpool grudgingly join forces to battle an author-turned werewolf...but when a bounty is declared on Wolvie\'s head; Deadpool plans to collect! Who is after Logan this time - and why? Plus; Wolverine and Spider-Man go underground to face the Mole Man; while Zaran the Weapons Master lies in wait! And a classic for the ages reveals the origin story they said could never be told. Meet sickly young James Howlett -the boy who will one day be Wolverine!'),
(3050, 3050, 'Collects X-Men (1991) #70-79; X-Men/Dr. Doom Annual 1998 and material from X-Men Unlimited (1993) #18. Will Marrow; Maggott and Dr. Cecilia Reyes usher in a new golden era for the X-Men? As Cyclops and Phoenix retire from the team; it\'s left to Wolverine to make sure they do! But with the roster split over the volatile Marrow\'s presence; keeping the X-Men from fracturing won\'t be easy. Can the inexperienced new team members step up in time to stave off an invasion from the demonic N\'Garai dimension? Plus; Joseph may be made to pay for Magneto\'s crimes! Angel battles the Abomination! Marrow takes action to save the Morlock tunnels! Maggott explores his origins! The Shadow King targets Psylocke as a psi-war begins! And the silver age Doctor Doom undertakes a quest through time to learn the secrets of Onslaught!'),
(3051, 3051, 'Collects X-Men Gold (2016) #16-20. A cosmic epic; X-Men style! Alien invaders have come to reclaim one of their own; and they\\u2019re taking one of our heroes with them! That means the rest of the team must follow \\u2014 into the Negative Zone! But as the truth of the situation slowly unfolds; what does the mysterious Kologoth have planned;next? Can the X-Men defeat a god with the fate of an entire world \\u2014 not to mention a fledgling romance \\u2014 hanging in the balance? What are they;willing to sacrifice? Taking on the might of Scythian will come at a cost \\u2014 one that might kill them all! Can even the X-Men survive on a barren planet?'),
(3052, 3052, 'The explosive outer-space epic that revitalized Marvel\\u2019s cosmos! Drax the Destroyer gets a new look; a fresh purpose \\u2014 and a surprising friend. But when Annihilus; lord of the Negative Zone; unleashes his monstrous Annihilation Wave on our universe; the galaxy\\u2019s greatest heroes \\u2014 and some you might call villains \\u2014 must brace for war! Annihilus\\u2019 opening salvo devastates the Nova Corps; and Richard Rider\\u2019s life is changed forever! Can he carry the Corps\\u2019 powerful Worldmind alone without going mad? Silver Surfer unites with his fellow heralds to protect Galactus; but what dark bargain must he strike? And a personal mission takes Super-Skrull to the Negative Zone \\u2014where he faces betrayal! Plus: Quasar takes on Annihilus; and only one will survive! Collecting DRAX THE DESTROYER #1-4; ANNIHILATION PROLOGUE; ANNIHILATION: NOVA #1-4; ANNIHILATION: SILVER SURFER #1-4 and ANNIHILATION: SUPER-SKRULL #1-4.'),
(3053, 3053, 'And there came a day; a day unlike any other; when Earth\\u2019s mightiest heroes and heroines found themselves uncolored; without their common palette! On that day; the Avengers were adorned - with all the hues no single super hero could withstand! Through these pages; their roster prospers; changing many times; but their glory will never be denied! Heed the call; then - for now; you Artists Assemble! Yes; your big moment is here. Captain America; Iron Man; Thor; Black Widow; Hawkeye; Hulk; Vision; Scarlet Witch; Quicksilver; Black Panther; Captain Marvel; Falcon and more take action in beautiful black-and-white illustrations by some of Marvel\\u2019s finest talents from across the eras! They\\u2019re just waiting for you to enter the fray - so grab your full lineup of markers; pencils or crayons - and unleash an Avengers world of color!'),
(3054, 3054, 'Project PEGASUS hires the Ever-Lovin\\u2019 Blue-Eyed Thing as its security chief \\u2014 but what\\u2019s the point if the base is already filled with super villains? It\\u2019s the classic saga; featuring all your favorites \\u2014 including Hercules and Thundra; Deathlok and Doctor Strange; Captains America and Marvel; Man-Thing and - classic Thing? Watch as bashful Benjy faces action in Olympus and the Nexus; and from Hollywood to Yancy Street! Gasp as three heroes debut new identities! And thrill to all the fun of Super Hero Poker Night! Plus: Will lending a hand protecting the facility from the Lava Men earn Spider-Man a spot on the Avengers? Or will a super villain riot lead to pandemonium at Project PEGASUS?! Collecting MARVEL TWO-IN-ONE (1974) #42-43 and #53-58; and AVENGERS (1963) #236-237.'),
(3055, 3055, 'Reprinting Venom (2011) #1!'),
(3056, 3056, 'Reprinting Venom (2016) #6!'),
(3057, 3057, 'Reprinting Venom (2011) #17!'),
(3058, 3058, 'Two of the Marvel Universe\\u2019s mightiest races are on a collision course \\u2014 but first Thor must deal with the escalating War of the Realms! To face Malekith; Loki and an all-new Kurse; she\\u2019ll need a team of her own. Prepare for the triumphant return of the League of Realms! Far across the galaxy; though; another conflict is brewing as the most powerful super-army in the cosmos prepares a surprise attack on the city of the gods! The Shi\\u2019ar Empire will lay siege to Asgardia \\u2014 and its target is the Goddess of Thunder! But why? And what does the fate of Midgard have to do with it? And where the Shi\\u2019ar go; the Phoenix Force tends to follow \\u2014 which is bad news for Thor! Maybe the returning Odinson could lend a hand \\u2014 or perhaps; Quentin Quire?! Collecting MIGHTY THOR (2015) #13-19.'),
(3059, 3059, 'Collects Thor Vs. Hulk - Champions of The Universe #1-6. An Elder of the Universe has come to Earth; and he means to battle our planet\'s strongest hero. But will Thor and Hulk ever agree on which one of them that is? Of course not! Asgard\'s Avenger and the green goliath will have to run a gauntlet of impossible challenges to prove their worthiness to face down this cosmic menace \\u2014 but what\'s really waiting for them at the finish line? And can even the two mightiest heroes on the planet smash their way out of this one? Find out in a cosmic battle for the ages!'),
(3060, 3060, 'AVENGERS VS. INHUMANS! When several townspeople mysteriously transform into primitive beings; the AVENGERS must step in and try to help.'),
(3061, 3061, 'Collects Marvel Two-In-One (1974) #21-36. The Ever-Lovin\' Blue-Eyed Thing is back with the Marvel Universe\'s greatest stars and one from a world all his own. The Marvel Masterworks are proud to reprint; for the first time ever; the Thing\'s MTIO adventure with Doc Savage! It kicks off a multipart saga spanning decades and the cosmos itself; and this will be your only chance to experience the story! The adventure doesn\'t stop there; either. Deathlok arrives on an assassination mission; and the Thing must stop him. Thor; Iron Fist; Black Goliath; Nick Fury; the Sub-Mariner; Shang-Chi and Spider-Woman will enter the fray; all while Mr. Fantastic seeks to free Deathlok\'s mind. And if that\'s not enough for you; the Bermuda Triangle sends the Thing back in time and he punches some dinosaurs!'),
(3062, 3062, 'The Fenris Wolf takes a bite out of the Avengers! The solar eclipse has ushered in Ragnarok! With a little help from the undead warrior women called the Disir; of course. Now; the Fenris Wolf of Norse legend is ready to swallow the sun and bring about the end of the world \\u2013 and only the Avengers stand in his way!'),
(3063, 3063, 'Collects Astonishing Tales (1970) #17-20; Ka-Zar (1974) #1-5; Shanna the She-Devil (1972) #1-5; Daredevil (1964) #110-112; material from Daredevil (1964) #109; Marvel Two-In-One (1974) #3. Ka-Zar the Lord of the Hidden Jungle meets Shanna the She-Devil for the very first time in this massive Marvel Masterworks! These two heroes were from separate realms; but after both rejected the modern world and its concrete canyons it was inevitable their paths would cross deep in the jungle. Ka-Zar must first conquer a madman powered by the Super-Soldier serum; the twin villain Gemini and Ka-Zar\'s brother the Plunderer; while Shanna hunts her father\'s killers; explores the jungle\'s mysteries and battles the Mandrill and priestess Nekra. After their paths diverge; Ka-Zar will encounter an evolved incarnation of his Savage Land nemesis in adventures with Bobbi Morse; the S.H.I.E.L.D. agent known as Mockingbird. Meanwhile; Shanna completes her quest to avenge her father alongside Daredevil.'),
(3064, 3064, 'FAST TIMES AT MIDTOWN HIGH Part 2! Between AP high school classes; extracurriculars at the X-Mansion and saving the New York streets from the most sinister of villains; it\\u2019s easy to say Annie May Parker has a tight schedule. But when two schoolmates mysteriously obtain super-powers; she takes it upon herself to keep them in line\\u2026despite her parents\\u2019 best wishes.'),
(3065, 3065, 'NO SURRENDER Part 11 THE AVENGERS WEEKLY EPIC CONTINUES! The Avengers are in the fight of their lives trying to end the Hulk\\u2019s rampage; but nothing can stop the unstoppable. And when an Avenger betrays the team; can the rest of the heroes hope to survive?'),
(3066, 3066, 'PAST FEARS BEGINS! Travel back to an untold tale in Cable\\u2019s past - when he was the leader of the New Mutants! What happened on this day that Cable hasn\\u2019t spoken of since? And how will this affect him today? From the new creative team of writing duo Zac Thompson and Lonnie Nadler (THE DREGS) and artist GERMAN PERALTA (THANOS)!'),
(3067, 3067, 'When the Guardians learn that Gamora hasn\'t been honest with them; they get angry. But who knows; you might like the Guardians when they\'re angry! Can the team stop threatening each other long enough to get the goods they\'ve been hired to procure?'),
(3068, 3068, 'SECRET EMPIRE TIE-IN! The U.S.Avengers have been broken \\u2014 but now it\'s time to fight back! In exile...believed dead...surrounded by HYDRA forces... Squirrel Girl and Enigma get a much-needed assist\\u2026from Guillotine and the Champions of Europe!'),
(3069, 3069, 'The time has come! Their ranks shattered by CIVIL WAR II; their spirits weighted down by a toll both personal and spiritual; Earth\'s Mightiest Heroes must find the resolve to stand united one final time against their greatest foe! The Avengers will assemble once more: Captain America! Thor! Vision! Wasp! Spider-Man! Hercules! But when the dust settles; will any of these valiant warriors make it out alive from an all-out war with Kang the Conqueror?! And when the Vision sets out hell-bent on revenge against Kang; all of history will be in jeopardy if the Avengers can\'t stop the synthezoid! The Firewall of Time will be shattered \\u2014 and it will fall to the Avengers to stop the dangers it held back! When war after war ends; not everything \\u2014 or everyone \\u2014 will be the same! Collects Avengers (2016) #1-6.'),
(3070, 3070, 'The Guardians of the Galaxy have been grounded! The spacefaring super heroes are stuck; of all places; on Earth. How and why have the Guardians become stranded here; and what are they going to do about their new situation? And to make matters worse; they\'re also not necessarily a team anymore. Just what\'s an urban spaceman to do? What would you do? Collects Guardians of the Galaxy (2015) #15-19.'),
(3071, 3071, 'Super heroes \\u2014 they\'re a privileged class. Doing what they want; when they want; and never facing the consequences. They have no regard for the ordinary people left behind to suffer in their wake. Who will stand up for the little guy? Clint Barton; the original Hawkeye; will! Clint doesn\'t look for trouble; but trouble keeps finding him \\u2014 and he\'ll quickly drag Red Wolf and Nighthawk into his street-level heroics; as well! But what happens when Nick Fury \\u2014 the original Nick Fury \\u2014 arrives on the scene? Isn\'t he dead? If so; someone who looks a lot like him is out to kill Clint and his renegade team! What\'s going on; and can Clint keep his eye on the ball while dealing with spymasters and sabotage? Plus: Relive Red Wolf\'s classic debut! Collects Occupy Avengers #1-4 and Avengers (1963) #80-81.'),
(3072, 3072, 'Peter Quill might have been born on Earth; but he\'s been away a long time. And now that the Guardians of the Galaxy have gone and gotten themselves stranded on terra firma; how does a man go from soaring through the stars as the legendary Star-Lord to living with his feet planted firmly on the ground? What kind of job options are available for a guy whose r\\u00e9sum\\u00e9 mostly consists of \\guarding the galaxy\\\"? And with all the dangers he has faced and survived'),
(3073, 3073, 'Their goal is a simple one\\u2026ERADICATE ALL MUTANTS! And they\'re starting their hunt with the most dangerous group of mutants on planet Earth \\u2014 Old Man Logan; Sabretooth; Domino; Lady Deathstrike; Warpath and\\u2026the Hulk?! But with an army of genetic cyborgs at their disposal; this may just be the beginning\\u2026'),
(3074, 3074, 'FOOLS RUSH IN! When an enemy she thought she\'d punched away returns; America will have to face the facts: She messed up. What will her mistakes cost her \\u2014 and the people she loves? One thing\'s for sure: She\'s gonna need help. Good thing she\'s the leader of the Ultimates! Uh; they\'re around; right? Guys? And while America fights the good fight; the mysterious figure behind those time-travel mishaps makes a move! Who is Madrimar; and what does she want with America?'),
(3075, 3075, 'SPIDER-MAN RETURNS TO THE FRIENDLY NEIGHBORHOOD! The webslinging; wallcrawling wonder returns to New York City in the all-new PETER PARKER: THE SPECTACULAR SPIDER-MAN. A companion series to the best-selling Amazing Spider-Man series; Peter Parker is going back-to-basics for big heroics in the Big Apple. Featuring adversaries old and new; be there as Spider-Man returns to his friendly neighborhood for his never ending battle against crime and the dreaded \\Parker Luck\\\".\"'),
(3076, 3076, 'The complete collection of Powers: Bureau is here - and it\'s a bold game changer! Now that all powers cases are federal cases; Christian Walker and Deena Pilgrim are now federal agents; and must learn to live by the new rules. But when they find themselves dealing with the biggest powers cases in the entire country; will this new life close the closet full of skeletons Deena carries with her? (Absolutely not!) Who are THE SEVEN? An explosive new super-team with a secret that could rock the world! Get on board the creator-owned series that shows cops and capes like you\'ve never seen them before!'),
(3077, 3077, 'Welcome to the ruins of Hala! Once; this world was ruled by a noble family; promising a new dawn for the Kree Empire. But then...the House of Boltagon decided they had better things to do. And in their absence; Hala died. Now the Royals stand accused \\u2014 and Ronan; last survivor of Hala; is the Accuser!'),
(3078, 3078, 'DEBUT OF THE ALL-NEW PATRIOT! Living in the Hydra Nation doesn\'t have to be all bad; especially if you can get with the program. But even in times of peace; some folks help but fight for what\'s right. Featuring The Invaders; Hydra Bob and introducing the all-new Patriot!!'),
(3079, 3079, 'A saga of life; death and obsession decades in the telling! The sorcerer Xandu is desperate to restore the love of his life to the land of the living \\u2014 and he needs the Wand of Watoomb! But time and again; Doctor Strange and Spider-Man stand in his way. Xandu\'s quest to revive his beloved will involve another arcane artifact \\u2014 the Crystal of Kadavus \\u2014 and even drag the Scarlet Witch into the action! But will Xandu\'s plan result in all life as we know it crumbling into dusty death? Plus: Spidey/Strange team-ups throughout the years \\u2014 in battle with the Wraith; Silver Dagger; Baron Mordo and more! Collects Amazing Spider-Man Annual #2 And #14; Marvel Team-Up (1972) #21; #50-51; #76-77 And #80-81; Spider-Man/Doctor Strange: The Way To Dusty Death; Untold Tales Of Spider-Man: Strange Encounter; And Material From Marvel Fanfare (1982) #6.'),
(3080, 3080, 'Poe Dameron has never been one to follow the rules. So when he disobeys a direct order from General Leia Organa and gets stranded in First Order space\\u2026with no ship and little oxygen\\u2026how will he survive?'),
(3081, 3081, 'Who \\u2014 or what \\u2014 is the Cosmic Jailer? What being could be powerful enough to chain Eternity itself? That\\u2019s the mystery Galactus must solve \\u2014 before it\\u2019s too late. Ultimate problems require ultimate solutions; and the former World-Eater will call on those who helped cure his insatiable hunger: Captain Marvel; Black Panther; Blue Marvel; Spectrum and Ms. America! Together they are the Ultimates; protectors of the Omniverse. But now they are something more \\u2014 the newest heralds of Galactus the Lifebringer! And they specialize in the impossible \\u2014 like the Shaper\\u2019s Ghost! Master Order and Lord Chaos! And the terrifying new entity Logos! Meanwhile; Philip Vogt knows the truth \\u2014 and faces a decision that will either save the Multiverse; or damn it forever! And the Troubleshooters are watching the Ultimates \\u2014 and they don\\u2019t like what they see. Collecting Ultimates 2 (2016) #1-6.'),
(3082, 3082, 'From a hidden base in the Rocky Mountains a coalition of heroes have staged a resistance against Hydra and their former friend; Steve Rogers. Up until now; their successes have been few \\u2014 but they may have discovered a way to end the long national nightmare. The only catch? They\'ve got to brave the dangers of the Savage Land!'),
(3083, 3083, 'Join Vader as he learns a new way \\u2014 the way of Darth Sidious and his newly formed Empire\\u2026the way of the dark side.'),
(3084, 3084, 'When a newly manifested mutant signals the X-Men for help; Iceman teams up with Kitty Pryde to stage a rescue mission! And surely nothing can go wrong when you ask your former girlfriend for advice on meeting guys while you\'re in the middle of a firefight; right?'),
(3085, 3085, 'Riri Williams strikes out on her own as her idealism is pushed to the test by a world she does not understand yet. How far is Riri willing to go to do what she knows is right?'),
(3086, 3086, 'A BROKEN CAGE! There\'s a war brewing in New Orleans\\u2026and Luke is right in the middle of it! Luke recovers from a brutal attack with the help of a VERY unsuspected ally! Luke Cage will put body and soul on the line to learn the truth about Dr. Burstein. He might live to regret that. MIGHT.'),
(3087, 3087, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3088, 3088, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3089, 3089, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3090, 3090, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3091, 3091, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3092, 3092, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3093, 3093, 'When fate calls; a sensational super-team answers! The avenging Angel! Hercules; Prince of Power! The deadly Black Widow! Ghost Rider; Spirit of Vengeance! And the amazing Iceman! When the Champions come together; it is legendary! So much so they\\u2019ll face the mythological might of Cerberus; harpies; Amazons and Greek gods \\u2014 all culminating in a wedding-stopping assault on Olympus! This mixed-up band might just be the heroes Los Angeles needs. And with the best headquarters Warren Worthington III\\u2019s money can buy; and Darkstar added to the ranks; they\\u2019ll be ready for the most uncanny of evils \\u2014 like Swarm; Nazi scientist turned lord of killer bees! Only one group can stop the City of Angels from feeling his sting. They are the Champions \\u2014 and they\\u2019ll keep on fighting \\u2018til the end! Collecting CHAMPIONS #1-3 and #14-15.'),
(3094, 3094, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3095, 3095, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3096, 3096, 'This MCU guidebook delves into the past of S.H.I.E.L.D.! Our comprehensive coverage of the fan-favorite Marvel Studios films and Marvel Television shows continues as we profile Agent Peggy Carter\\u2019s 1940s organization; the SSR! Featuring fact sheets; show-to-comic comparisons; and behind-the-scenes production art and stills; this fantastic book is packed with profiles and updates on Agent Carter; Edwin Jarvis; Chief Roger Dooley; Agent Daniel Sousa; Agent Jack Thompson; the Howling Commandos; Angie Martinelli; Dottie Underwood; Johann Fennhoff; Leviathan; Howard Stark and more! Relive the thrills of Marvel\\u2019s Agent Carter Season One right here; and continue building your indispensable library of Marvel Cinematic Universe reference books!'),
(3097, 3097, 'For Steve Rogers; the hardest thing about being a man out of time is being a man without a best friend. As Captain America comes to terms with his loss; he longs for the black and white moral simplicity of World War II: Bucky Barnes charging fearlessly into battle at his side. The Howling Commandos right behind. Odds against them; lives on the line; taking the fight to the greatest evil of all. The Eisner Award-winning team of Jeph Loeb and Tim Sale (DAREDEVIL: YELLOW; SPIDER-MAN: BLUE and HULK: GRAY) revisit the glory days of Captain America and Bucky in a classic tale of a friendship forged in war. Collecting CAPTAIN AMERICA: WHITE #0-5.'),
(3098, 3098, 'After everything that\\u2019s happened; Spider-Man and Deadpool want some R & R. But PATIENT ZERO and ITSY BITSY aren\\u2019t going make their lives very restful\\u2026'),
(3099, 3099, '\\u201cCLONE CONSPIRACY\\u201d TIE-IN! \\nDeath is no more; and DOCTOR OCTOPUS HAS RETURNED!!! How is he back? And what does he have to do with The Jackal?'),
(3100, 3100, 'The trial of Ant-Man! Order in the court. Darren Cross is out for revenge! (And out of the office \\u2013 see autoreply).'),
(3101, 3101, '\\u201cLION TAMER\\u201d STARTS NOW!\\nNow that Natasha knows the Weeping Lion\\u2019s secret; she\\u2019s in control of his very particular set of skills. Natasha plans to use him to destroy the Red Room\\u2019s reincarnation; the DARK ROOM. But she\\u2019ll have to face RECLUSE; the daughter of the Red Room\\u2019s headmistress; who\\u2019s fixated on killing Natasha to prove her worth.'),
(3102, 3102, '\\u201cBLOOD IN THE AETHER\\u201d STARTS NOW!\\nDoctor Strange is on the brink of death; his magic nearly depleted. Sensing the Sorcerer Supreme at his weakest; his greatest foes will return from the shadows; ready to strike. Behold the return Doctor Strange\\u2019s classic rogues gallery starting with...BARON MORDO!'),
(3103, 3103, 'Silk and friends continue their search for her parents in THE NEGATIVE ZONE! What they find will shock you.');
INSERT INTO `descripcion_comics` (`id_descripcion`, `id_comic`, `descripcion_comics`) VALUES
(3104, 3104, 'Gwen and the Mary Janes go to a haunted house for a laugh. But Earth 65 MYSTERIO will show them how serious haunting can be\\u2026'),
(3105, 3105, 'Forged from the mystical metal known as Uru; Thor\\u2019s Hammer is the key to a power that only the worthy can wield. But what makes one worthy to carry this weapon? Is it destiny? Or does the hammer choose its partner? Discover the storied history of Thor\\u2019s greatest ally \\u2014 The MIGHTY MJOLNIR!'),
(3106, 3106, 'CIVIL WAR II TIE-IN! Iron Man has taken the fight back to New Attilan! When the War is over; will the Royal Family ever be the same again?'),
(3107, 3107, 'Amadeus Cho loves being the Hulk -- and he\\u2019s determined to be the greatest hero the world\\u2019s ever seen. But if the Hulk is driven by rage; what lies within Amadeus? Unfortunately for him; the Enchantress; Amora of Asgard; is hell-bent on finding out!'),
(3108, 3108, 'When Steve Rogers was restored to his natural age; he chose one of his closest and most trusted allies to take up his shield: Sam Wilson; formerly the Avenger known as the Falcon! But Sam isn\'t Steve; and after recent events he\'s on the outs with both his old friend and S.H.I.E.L.D. What could have sent the high-flying new Cap\'s approval rating plummeting so dramatically? Things get slithery when the vile Sons of the Serpent make the scene; and you\'ll howl at the glorious return of fan-favorite Cap-Wolf - well; Fal-Cap-Wolf! But what other horrors await in the dungeon of Doctor Malus? And who will be the All-New; All-Different Falcon? The headline-making Sam Wilson is a Captain America for today! COLLECTING: CAPTAIN AMERICA: SAM WILSON #1-6.'),
(3109, 3109, 'EVERYTHING IS NEW. In the wake of SECRET WARS; the old order changeth - and Bobby DaCosta; Sunspot; is just the man to changeth it. Welcome to AVENGERS IDEA MECHANICS -- a super-scientific global rescue squad of tomorrow\'s heroes...today! America doesn\'t want them! S.H.I.E.L.D. doesn\'t know what to do with them! But Earth might not survive without...the NEW AVENGERS! COLLECTING: New Avengers #1-6; Avengers #0 (New Avengers story).'),
(3110, 3110, 'A STANDOFF tie-in! Captain America Unite! Sam Wilson; Steve Rogers; and Bucky Barnes team up for a heroic stand against the evil that lurks in Pleasant Hill. Continues the blockbuster spring Avengers event; STANDOFF!'),
(3111, 3111, 'As the situation with the Eridani delegates escalates; Captain Marvel and her crew struggle to make sense of what happened on the mysterious alien craft. But between her powers failing and Wendy\\u2019s character being called into question; Carol\\u2019s command of Alpha Flight is slowly slipping from her grasp.'),
(3112, 3112, 'CAPTAIN AMERICA and BLACK WIDOW must train the new Avengers recruits to work together as a team. Their first mission: stop the giant robot; ULTIMO! Featuring SCARLET WITCH; VISION; FALCON and WAR MACHINE! Bonus TALES OF SUSPENSE #58 included.'),
(3113, 3113, 'Sam Alexander learns the truth about the man who\\u2019s been masquerading as his father \\u2026 and it\\u2019s going to send him back into space! The seeds of Nova\\u2019s next cosmic adventure are planted right here!'),
(3114, 3114, 'College is stressful; so Adam and Kevin hit the school gym for a little workout; a little flirting and a little confrontation with a cosmically-enhanced LIBRA; who\\u2019s weighing Starbrand and Nightmask\\u2019s ultimate value to ETERNITY!!!'),
(3115, 3115, 'Call them a duo with a special kind of dynamics...call them the odd couple but with guns...call them 90s comics distilled down into two characters-DEADPOOL AND CABLE ARE BACK; BABY! That\'s right-The Merc with the Mouth and the Soldier with the Scowl are together again in this all-new series! When Cable gets a vision of a terrible future set off by the death of one man; he knows he must protect him no matter what! I\'ll get you three guesses who\'s been hired to kill that guy. Go on; guess. COLLECTING: DEADPOOL & CABLE: SPLIT SECOND (2015) #1-3.'),
(3116, 3116, 'Obi-wan and Anakin are trapped on opposite sides of a war...and if they\\u2019re not careful; they\\u2019re going to get caught in the crossfire! Plus...why does Anakin want to leave the order?\\n\\nStar Wars \\u00a9 Lucasfilm Ltd. & TM. All rights reserved. Used under authorization. Text and illustrations for Star Wars are \\u00a9 2015 Lucasfilm Ltd.'),
(3117, 3117, 'IT\\u2019S HYPERION VERSUS THE CARNIVAL! Hyperion has shown his true atomic hero self to the hitchhiker; Doll; and now he and her are right in the crosshairs of a crew of hell-powered freaks and deviants. Throw in a murder mystery; a crime syndicate and a stray dog and it all adds up to an unholy heap of trucker trouble.'),
(3118, 3118, 'Getting to the airport is always a hassle. Getting a Russian mobster to the airport for trial relocation while avoiding The Punisher and mob associates can be deadly! Daredevil has trained Blindspot well; but nothing can prepare him for what will happen next!'),
(3119, 3119, 'BROMANCING THE STONE! POWER MAN and IRON FIST are swimming through New York City\'s currents of crime trying to retrieve the SUPERSOUL STONE. Beware the underworld undertow! Meanwhile; JENNIE and BLACK MARIAH\'s nefarious plans begin to bear fruit. With a magic-fueled crisis at its tipping point and all of New York hanging in the balance it\'s the perfect atmosphere to rekindle a smoldering friendship; so GET IT TOGETHER ALREADY; LUKE AND DANNY!'),
(3120, 3120, 'Spidey and Silk\\u2019s time jaunt takes them all the way to their beginning...the science fair where they were bitten by the radioactive spider! Plus: Chronosaurus Rex revealed!'),
(3121, 3121, 'A STANDOFF tie-in! What could possibly hold its own against the American Kaiju? None other than \\u2013 AVENGER FIVE! Five New Avengers in the ultimate ultra-vehicle \\u2013 fighting to save A.I.M.! But are they giving up their freedom \\u2013 or their lives? Plus: The traitor revealed! Sunspot\\u2019s secret schemes! And the guest-star reveal you\\u2019ve been waiting for!'),
(3122, 3122, 'YOU CAN ENTER; BUT YOU CAN NEVER LEAVE\\u2026! Get ready to meet the 999 happy haunts residing in the mansion\\u2026but some of them aren\\u2019t quite so happy! Madame Leota! The Hatbox ghost! Constance the Bride! The Hitchhiking ghosts! You never know who of the legendary cast from Disney\\u2019s world-famous attraction will appear! Danny is trapped within the Haunted Mansion; but who is trying to help him; and who is using him for their own ghoulish plot? Don\\u2019t miss the next chapter in the delightfully chilling story based on the fan-favorite Disney attraction!\\nElements based on Haunted Mansion \\u00a9 Disney'),
(3123, 3123, 'Hermetikus\\u2019s evil ambitions are tremendous\\u2014you could say they\\u2019re GALACTIC in scale! Does this villain hold a strange connection to the Guardians 1000? Even though Rocket; Drax and Groot have joined a GUARDIANS SUPERGROUP; they might be in over their heads! Plus! Writer JEFF KING (White Collar) and artist FLAVIANO ARMENTERO show you what happens when Rocket and Kitty act as bodyguards for an interplanetary whistleblower!'),
(3124, 3124, 'Heeeeere\'s Hawkeye! Your favorite ex-bad guys are determined to break good; now that the ultimate reformed criminal is here to usher them into the big leagues of herodom -the Avenging Archer himself; Clint Barton! But can the Thunderbolts\' new leader fend off the old one; Citizen V? Or the Crimson Cowl and her new Masters of Evil? And just who is under that white mask and that red hood now anyway? COLLECTING: THUNDERBOLTS (1997) #23-37; THUNDERBOLTS ANNUAL 2000; AVENGERS ANNUAL 2000.'),
(3125, 3125, 'A brand new chapter in the SUSANNAH DEAN story begins here! THE GUNSLINGER has taken Odetta Holmes to Midworld to join his quest to reach the DARK TOWER! But little do ROLAND and EDDIE know that Odetta has a dark side that poses a threat to all of Midworld!'),
(3126, 3126, 'This issue has enough villains in it to choke a...uh...something that...eats villains; I guess...THE JUSTICE SYSTEM! Enough villains to choke the justice system.'),
(3127, 3127, 'THE LAST STAND OF THE SHIELD! Well; THAT certainly doesn\'t sound ominous... Hey look; THANOS is here! That\'s always a good sign! Just kidding; of course; that\'s terrible news and everything is darkness. The biggest battle conceivable. Heroes rise. Legends fall. No one lives forever. THIS IS THE SHIELD!'),
(3128, 3128, '\\u2022 Logan has climbed the walls and broken the barriers between the domains of Battleworld.\\n\\u2022 He has seen the horrors of the Post-Apocalypse world. Been hounded by this worlds thundering police force.\\n\\u2022 But his ignorance of this world\\u2019s laws will not protect him from its justice.\\n\\u2022 This Old Man is haunted by the dead. Let us see how he fairs with the \\u201cun\\u201d variety.'),
(3129, 3129, 'The truth behind the massive influx of new Powers is revealed; and Deena discovers that a terrible family secret is behind it all. An all-new; explosive chapter of the award-winning cops-and-capes mashup that\\u2019s taken the PlayStation Network by storm! Plus: another exclusive look behind the scenes of the POWERS TV show!'),
(3130, 3130, 'THE FINAL WAR!'),
(3131, 3131, 'The greatest space adventure of all returns to Marvel! Luke Skywalker and the ragtag rebels opposing the Galactic Empire are fresh off their biggest victory so far \\u2014 the destruction of the massive Death Star. But the Empire\\u2019s not toppled yet! Join Luke; Princess Leia; Han Solo; Chewbacca; C-3PO; R2-D2 and the rest of the Rebel Alliance as they fight for freedom against Darth Vader and his evil master; the Emperor! But when a Rebel assault goes wrong; Han and Leia must think fast to make their escape \\u2014 while Luke comes face-to-face with Darth Vader! In the explosive aftermath; a humbled Luke returns to Tatooine to learn more about his mentor; Obi-Wan Kenobi. Meanwhile; Leia and Han undertake a vital \\u2014 and dangerous \\u2014 secret mission. But can they succeed without Luke? Plus: the menace of Boba Fett! Collecting STAR WARS (2015) #1-6.'),
(3132, 3132, '\\u2022 Luke Skywalker...imprisoned!\\n\\u2022 His friends race across the galaxy to save him before he enters...\\n\\u2022 THE ARENA OF DEATH!'),
(3133, 3133, 'The original Dark Lord of the Sith stars in his first ongoing series! Ever since Darth Vader\\u2019s first on-screen appearance; he has become one of pop-culture\\u2019s most popular villains. Now; follow Vader straight from the ending of A NEW HOPE (and the pages of the new STAR WARS comic book) into his own solo adventures \\u2014 showing the Empire\\u2019s war with the Rebel Alliance from the other side! But when a Dark Lord needs help; who can he turn to? As Vader pursues a very personal vengeance against the Rebels and investigates the Emperor\\u2019s secret machinations; he clashes with weapons scavenger Aphra and deadly Battle Droids; and returns to Geonosis to build an army. But some very powerful people don\\u2019t want him to learn the truths he seeks! Guest-starring Jabba the Hutt; Boba Fett and more! Collecting DARTH VADER #1-6.'),
(3134, 3134, '\\u2022 For the first time in the new Star Wars canon; journey with us into the time after the end of Return of the Jedi! Writer Greg Rucka (PUNISHER; WOLVERINE; Gotham Central) and artist Marco Checchetto (AVENGERS WORLD; PUNISHER) take us past the destruction of the second Death Star into the chaos of a Shattered Empire.\\n32 PGS. (each)/Rated T+ ...$3.99 (each)\\nStar Wars \\u00a9 Lucasfilm Ltd. & TM. All rights reserved. Used under authorization. Text and illustrations for Star Wars are \\u00a9 2015 Lucasfilm Ltd.'),
(3135, 3135, 'The original Star Wars comic-book saga concludes! Savor an all-action adaptation of Star Wars: Episode VI \\u2014 The Return of the Jedi; and find out what happens after the Battle of Endor! Luke; Leia and their allies seek to establish a new galactic government \\u2014 but Imperial Forces still stand in the way. When Darth Vader falls; a Dark Lady will rise! Meanwhile; Han Solo and Chewbacca head to Wookiee World! The Ewoks go to war! And tragedy strikes close to C-3PO \\u2014 could it be that even a droid can cry? Plus: a cornucopia of Star Wars rarities \\u2014 including exclusive stories only published in the UK! Collecting STAR WARS (1977) #79-107 and ANNUAL #3; and RETURN OF THE JEDI #1-4 \\u2014 plus material from PIZZAZZ #1-16; STAR WARS WEEKLY (UK) #60; #94-99 and #104-115; EMPIRE STRIKES BACK MONTHLY (UK) #149; #151 and #153-157; and STAR WARS MONTHLY (UK) #159.'),
(3136, 3136, 'The original Star Wars comic-book saga concludes! Savor an all-action adaptation of Star Wars: Episode VI \\u2014 The Return of the Jedi; and find out what happens after the Battle of Endor! Luke; Leia and their allies seek to establish a new galactic government \\u2014 but Imperial Forces still stand in the way. When Darth Vader falls; a Dark Lady will rise! Meanwhile; Han Solo and Chewbacca head to Wookiee World! The Ewoks go to war! And tragedy strikes close to C-3PO \\u2014 could it be that even a droid can cry? Plus: a cornucopia of Star Wars rarities \\u2014 including exclusive stories only published in the UK! Collecting STAR WARS (1977) #79-107 and ANNUAL #3; and RETURN OF THE JEDI #1-4 \\u2014 plus material from PIZZAZZ #1-16; STAR WARS WEEKLY (UK) #60; #94-99 and #104-115; EMPIRE STRIKES BACK MONTHLY (UK) #149; #151 and #153-157; and STAR WARS MONTHLY (UK) #159.'),
(3137, 3137, 'Jack Kirby earned the nickname \\u201cKing\\u201d over 50 plus years in comics; from co-creating Captain America to the Fantastic Four to Devil Dinosaur. In addition; Jack\\u2019s explosive layouts; high drama and fantastic imagination helped evolve the art form in ways few others can claim. Now; the House of Ideas explores that work in THE MARVEL LEGACY OF JACK KIRBY HC. In essays and commentary; this deluxe; oversized volume reviews the comics; the influence and the times of Kirby; and puts a special focus on the month that changed everything; November 1961. Don\\u2019t ask \\u2014 just buy!!!'),
(3138, 3138, 'What if Thanos joined the Avengers?  Thanos made a deal with the Avengers to use his army to protect Earth from the invading forces; but it came with a cost...'),
(3139, 3139, 'What if the INHUMANS took over Earth?  BLACK BOLT is the new supreme ruler of Earth; but what happened to Earth\'s Mightiest Heroes?'),
(3140, 3140, 'The magical day has arrived: Deadpool and succubus queen Shiklah tie the knot! But when Deadpool and his bride honeymoon in Japan; will married life agree with our mouthy merc? Or will he start doing the \\u201ctake my wife; please\\u201d joke all the time? Meanwhile; Agent Preston makes a surprising discovery: Deadpool has a daughter! And there\\u2019s more to her life than meets the eye! But Deadpool is up to his neck fighting Dracula\\u2019s forces \\u2014 can he escape in time to safeguard his own flesh and blood? And where did his daughter even come from? Deadpool\\u2019s Original Sin is revealed as we learn the very darkest chapter of Deadpool\\u2019s dark past! Plus: Deadpool and Nick Fury fight Hitler! And Deadpool \\u201cteams up\\u201d with Madcap (it\\u2019s gross)! Also featuring stories by every single Deadpool writer ever! Collecting DEADPOOL (2012) #26-34 and ANNUAL #1.'),
(3141, 3141, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3142, 3142, '\\u2022 CYCLOPS and his OLD - ahem; CLASSIC - X-MEN continue to resist the idea that they are outclassed in every way by MAGNETO and his newer; younger; and more attractive team of X-MEN.'),
(3143, 3143, 'THE CURSE OF VICTORY! ROBBIE REYES may have broken free of the KILLISEUM races but what at what terrifying cost? What is the fate of the other racers JOHNNY BLAZE; DANNY KETCH; ALEJANDRA BLAZE; SLADE and ZERO COCHRANE after their betrayal to ARCADE? Can anyone truly win on the TRACK OF TREACHERY?'),
(3144, 3144, 'Oscar Greenberg is not your typical vampire. He doesn\'t drink human blood; for one. He\'s a successful author - albeit prone to writer\'s block. And he\'s a good son; who\'s kept his secret from his dear old Mama. Oscar\'s also very much in love with Denise; the vamp who turned him. Their happily ever after might actually last forever - unless someone comes between them. Someone like Arthur Keaton: Vampire Hunter; who also happens to be Denise\'s brother! Then there\'s the demonic Lilith; who\'s long had designs on Oscar. She\'ll go to great lengths to seduce him; in a bid to usher the world into a new age of wanton lust. Can true love conquer all; even for the undead? Rediscover a forgotten tale of fangs; family and infatuation! Collecting MARVEL GRAPHIC NOVEL #20 and material from BIZARRE ADVENTURES #29.'),
(3145, 3145, 'The Guardians of the Galaxy are caught in the pull of the Black Vortex!\\nWith the Slaughter Lords hot on their tails; the X-Men and the Guardians\\nmust find somewhere to stash their precious cargo; but will the temptation\\nof the Vortex\'s unknown power be too much for this band of misfits? Rocket\\nleaps into action! Gamora goes on the offensive! Ronan is deposed!\\nStar-Lord is defiant! This story has it all - but does it seem like the\\nGuardians have forgotten something in all the cosmic craziness? Oh; that\'s\\nright; Peter got elected president of Spartax! Wait; what?! As rifts begin\\nforming within the team; will their friendship and history be enough to\\nhold the Guardians together? Plus: What is a S.H.I.E.L.D. Helicarrier\\ndoing floating in space?! Collecting GUARDIANS OF THE GALAXY (2013) #24-27\\nand ANNUAL (2015) #1.'),
(3146, 3146, 'Nomad stands his ground; the teachings of Steve Rogers endure. With the world crashing down on top of him; Ian Rogers struggles to get home. Who is Poison and why is she willing to help Nomad?'),
(3147, 3147, 'Hydra initiates the next step in their scheme; millions of innocent souls hang in the balance. Cap is broken and nearly dead from the gauntlet of the new Hydra; so how can he take down the combined might of Cobra and the Armadillo in time to stop the great leveling? A mysterious woman from the past returns!'),
(3148, 3148, '- Cap and Nomad reunited!\\nThere\'s not much this dysfunctional duo can\'t handle...\\n- Except; of course; when one of them is having a violent psychotic episode.'),
(3149, 3149, 'BEFORE TIME RUNS OUT!\\nHow did things get to be the way they are in the \\Time Runs Out\\\" story? Find out here in AVENGERS WORLD!\\nCannonball and Smasher face their greatest adventure yet...parenthood!\\nCan the new parents survive an encounter with the SHI\'AR IMPERIAL GUARD?\"'),
(3150, 3150, 'Two of Spider-Man\'s deadliest foes; Hobgoblin and Carnage; take center stage - as heroes! In the wake of AXIS; Roderick Kingsley; the original Hobgoblin; is back in the suit and back in New York with a new mission: to make YOU the best you can be! But when Phil Urich; the former Hobgoblin; tries to get rid of Kingsley for good; will the heroic Hobgoblin be forced to revert to his wicked ways? Meanwhile; if symbiotic serial killer Carnage has given up villainy; then why has he kidnapped one of New York City\'s most beloved news anchors? The Sin-Eater returns; with a surprising mission - and if all this isn\'t enough for Carnage to worry about; he\'s still on the authorities\' most-wanted list! The effects of AXIS continue in this surprising saga - don\'t miss it! Collecting AXIS: HOBGOBLIN #1-3 and AXIS: CARNAGE #1-3.'),
(3151, 3151, 'The moment we\'ve all been waiting for: Natasha confronts Chaos!'),
(3152, 3152, '- The moment we\'ve all been waiting for: Natasha confronts Chaos!'),
(3153, 3153, 'Someone killed the man White Tiger hated most in the world - and now she has to bring that someone in!\\nMeanwhile - something very; very strange is happening to CORTEX Incorporated...\\n...and Luke Cage is right in the middle of it.'),
(3154, 3154, 'It\'s the return of the New Warriors; drawn by superstar artist Skottie Young (ROCKET RACCOON)! When Night Thrasher strikes a mysterious deal with a reality-TV producer; the New Warriors move out of New York - and into a very cramped van - to travel across America; and help small-town residents deal with the roving villains and superhuman threats that the major super-teams are too busy to tackle! But will the Warriors\' filmed exploits be uplifting; or just exploitative? And is heartland America ready for big-city super heroics? Find out as the Warriors take on Tiger Shark; the Armadillo; the Super-Apes; the Controller; the Mad Thinker\'s Intellectual Robots and more - and unknowingly set the stage for the superhuman Civil War! Plus: the sweeps-week debuts of Microbe and Debrii! Collecting NEW WARRIORS (2005) #1-6.'),
(3155, 3155, 'A search for his daughter lands Henry Hayes in the hospital.\\nWill SHIELD find him before BIOTEK does?\\nAndrea is in over her head; until a powerful friend comes to help.\\nDeathlok\'s future is uncertain as the first arc of the hot new series draws to a close!'),
(3156, 3156, '- A search for his daughter lands Henry Hayes in the hospital.\\n- Will SHIELD find him before BIOTEK does?\\n- Andrea is in over her head; until a powerful friend comes to help.\\n- Deathlok\'s future is uncertain as the first arc of the hot new series draws to a close!'),
(3157, 3157, 'The 3rd chapter of the BLACK VORTEX!\\nWith a schism forming within the assembled heroes; the youngest among them face the temptation of immeasurable power.\\nSometimes those with great power shirk their responsibility to use it for good; though.\\nAnd with Knife and his new business partner looking to take back the Black Vortex; the group may have left themselves defenseless.'),
(3158, 3158, 'Loki faces the punishment of the Gods! Have his sins found him out at last?\\nFeaturing: the pain of Volstagg! The verdict of Sif! The fury of Freyja! The strange wisdom of Odin!\\nAnd in the midst of all this drama... where\'s King Loki?'),
(3159, 3159, 'S.H.I.E.L.D. has Magneto in its clutches.\\nBut just what ace does Magneto have up his sleeve that might allow him to turn the tables on his captors?'),
(3160, 3160, 'Based on the highly anticipated new series coming to Disney XD in 2015; follow the further adventures of the Guardians of the Galaxy!\\nWith a galaxy full of danger; only the Guardians stand between us and the destruction of everything!\\nFeaturing adaptations of the upcoming animated series with a mix of screen grab and brand new stories for everyone to enjoy!'),
(3161, 3161, 'Carnage knows Nova\'s secret identity - and he can\'t wait to share it with Sam Alexander\'s whole school! What\'s worse; Nova\'s helmet is still on the fritz! When\'s this kid gonna catch a break?! Not today; when a Hulk makes an unexpected appearance!'),
(3162, 3162, 'The meanest; toughest; wittiest; and furriest Guardian of the galaxy just broke out his BIGGEST GUNS. Because it\'s ON. or ON-ER. THE MOST ON! Whatever; you get it. Join superstar Skottie Young and sensational artist Filipe Andrade (Captain Marvel; Figment) in a Rocket adventure that breaks all the rules (including grammar).'),
(3163, 3163, '- The meanest; toughest; wittiest; and furriest Guardian of the galaxy just broke out his BIGGEST GUNS.\\n- Because it\'s ON. or ON-ER. THE MOST ON! Whatever; you get it.\\n- Join superstar Skottie Young and sensational artist Filipe Andrade (Captain Marvel; Figment) in a Rocket adventure that breaks all the rules (including grammar).'),
(3164, 3164, '- The meanest; toughest; wittiest; and furriest Guardian of the galaxy just broke out his BIGGEST GUNS.\\n- Because it\'s ON. or ON-ER. THE MOST ON! Whatever; you get it.\\n- Join superstar Skottie Young and sensational artist Filipe Andrade (Captain Marvel; Figment) in a Rocket adventure that breaks all the rules (including grammar).'),
(3165, 3165, '- The end of the Blue File...and the end of an era!\\n- But when one door closes; another one opens; and Jen finds herself face to face with her most important case yet.'),
(3166, 3166, 'Cindy Moon exploded out of her bunker and into the Marvel Universe when we first learned that she had been bitten by that same radioactive spider in the first arc of AMAZING SPIDER-MAN. She then went on to save Peter Parker\'s life (more than once!) and traverse the Spider-verse alongside Spider-Woman. Now; as SILK; Cindy is on her own in New York City; searching for her past; defining her own future; and webbing up wrong-doers along the way! Robbie Thompson (writer from TV\'s Supernatural) fills this new ongoing series with his unique blend of antics and feels. Featuring stunning covers by Eisner Award winner Dave Johnson and interiors by future superstar Stacey Lee.'),
(3167, 3167, '\\THE FALL OF THE FANTASTIC FOUR\\\" PART 5 - Super-Sized issue!\\n- The Baxter Building is quarantined and shut down!\\n- The Fantastic Four held accountable for the destruction in Manhattan!\\n- A major turning point for the team and a dire blow to the family!\\n- The trial of the century featuring an all-star roster of guest artists!\"'),
(3168, 3168, '- Can the Red Room keep the Winter Soldier under control after Bucky\'s consciousness begins to surface?\\n- S.H.I.E.L.D. agent Ran Shen continues his desperate battle to save a woman who holds the key to the Cold War.\\n- HYDRA; S.H.I.E.L.D. and the Winter Soldier all play a role in creating the monster that will one day break Captain America!'),
(3169, 3169, '\\UNBREAKABLE\\\" PART 3\\n- Iron Patriot\'s family dances on the edge.\\n- The scope of the plan is revealed.\\n- James Rhodes dies.\"'),
(3170, 3170, '- New Inhumans are transformed every day as the Terrigen Mist spreads around the world.\\n- Queen Medusa finds herself face to face with Captain America; and it doesn\'t go well.\\n- Who is Lash and what does he want with the new Inhumans?'),
(3171, 3171, 'The adventures of a boy and his dinosaur! At the dawn of human evolution; during a time when primitive man co-existed with the dinosaurs that dominated the Earth; a unique friendship is born - a friendship that may be the only thing that can save mankind! Meet Moon Boy and his Tyrannosaurus pal - the red-skinned Devil Dinosaur - as they face off against giant spiders; enormous ants; and rampaging dinosaurs of all shapes and sizes! And don\'t forget the Small Folk; led by the warlord Seven Scars; who rejected Moon Boy for befriending the fearsome Devil - and who aim to dominate the forest by force! Throw in aliens from outer space; and you\'ve got a timeless romp through the ages - delivered courtesy of the imagination of Jack \\King\\\" Kirby! Collecting DEVIL DINOSAUR #1-9.\"'),
(3172, 3172, '- Unite or die! The Avengers Unity Squad pull it together; but is it too late?\\n- Which of the seven futures will become dominant? Kang\'s ultimate goal revealed!\\n- The Uncanny Avengers learn that even if you have no other choice; never trust Kang.'),
(3173, 3173, '\\UNBREAKABLE\\\" PART 3\\n- Iron Patriot\'s family dances on the edge.\\n- The scope of the plan is revealed.\\n- James Rhodes dies.\"'),
(3174, 3174, 'KIMOTA! With one magic word; a long-forgotten legend lives again! Freelance reporter Michael Moran always knew he was meant for something more-now; an unexpected series of events leads him to reclaim his destiny as Miracleman! The groundbreaking graphic novel that heralded a literary revolution begins here in A DREAM OF FLYING. After nearly two decades away; Miracleman uncovers his origins and their connection to the British military\'s \\Project Zarathustra\\\" - while his alter ego'),
(3175, 3175, '- Jim Starlin returns to Thanos; and he\'s brought INFINITY GAUNTLET artist Ron Lim with him!\\n- Thanos must face Mephisto; his future self; the Avengers and more!\\n- Learn how a devastating defeat in Thanos\' past set events into motion that will redefine the Marvel Universe in the near future!\\n- A prequel to the upcoming THANOS: THE INFINITY REVELATION original graphic novel!'),
(3176, 3176, 'THE ACTION-CRAMMED FINALE TO MARVEL\'S FIRST DISNEY KINGDOMS ADVENTURE! It\'s the strangest-and most treacherous- museum in history; and Melody and Maxwell Keep will have to fight through it to save their kidnapped parents! Save the world & doom their family- or save their family and doom the world? No matter what Melody and Maxwell choose; everyone is out to get them! Designed but never built by famous Walt Disney Imagineer Rolly Crump; the Museum of the Weird at last comes to life!'),
(3177, 3177, 'Cover by HUMBERTO RAMOS\\n- Young Peter Parker is the high school bullies\' favorite target. But all that changes the day a science experiment goes wrong; and Peter begins to transform!\\n- When a personal tragedy teaches Peter a harsh lesson in responsibility; he must find the inner strength to become a hero!\\n- Can the brand-new Spider-Man master his new powers in time to take on the villainous Vulture?\\n- When a giant robot spider attacks New York; Spider-Man must prove his innocence by tracking down the scientist responsible: the diabolical Dr. Octopus!\\n- When the sinister Sandman assaults Midtown High; it\'s up to Peter to stop him - even if must risk revealing his secret identity!\\n- Four titanic tales set in Spider-Man\'s past!'),
(3178, 3178, '- Jim Starlin returns to Thanos; and he\'s brought INFINITY GAUNTLET artist Ron Lim with him!\\n- Thanos must face Mephisto; his future self; the Avengers and more!\\n- Learn how a devastating defeat in Thanos\' past set events into motion that will redefine the Marvel Universe in the near future!\\n- A prequel to the upcoming THANOS: THE INFINITY REVELATION original graphic novel!'),
(3179, 3179, '- Jim Starlin returns to Thanos; and he\'s brought INFINITY GAUNTLET artist Ron Lim with him!\\n- Thanos must face Mephisto; his future self; the Avengers and more!\\n- Learn how a devastating defeat in Thanos\' past set events into motion that will redefine the Marvel Universe in the near future!\\n- A prequel to the upcoming THANOS: THE INFINITY REVELATION original graphic novel!'),
(3180, 3180, 'In the aftermath of INFINITY; Thane must come to terms with the knowledge that he is the son of Thanos. But when he is offered a route to the past to see his father\'s black work firsthand; can he retain his humanity? And what is the dark secret residing in The Mad Titan\'s war against Ego The Living Planet?'),
(3181, 3181, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3182, 3182, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3183, 3183, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3184, 3184, 'INHUMANITY tie-in! Mad scientist June Covington; aka Toxic Doxie; has her very own Inhuman - one with a unique ability that; in the wrong hands; could change everything. Now Covington\'s at war with A.I.M. for control of new Inhuman abilities! Meanwhile; young hero Spider-Girl is being mentored by Spider-Woman and Wolverine - but when she follows in her investigative-reporter father\'s footsteps and begins tracking Covington; Spider-Girl must enlist Iron Man\'s help to understand what\'s at stake; how to fight it - and if she\'s very lucky; how to recover a dear friend without ending up dead. Because there\'s a second Terrigen cocoon in New York; ticking like a time bomb; and it\'s about to go off. Acclaimed writer Warren Ellis reunites with Kelly Sue DeConnick for a delightfully demented dance through the Avengers roster! Collecting AVENGERS ASSEMBLE #21; #22.INH-23.INH and #24-25.'),
(3185, 3185, 'The arrival of the original X-Men in the present sent shockwaves through the Marvel Universe; but we\'ve only seen the effects on Earth - until now! When an alien race discovers that Jean Grey - host of the destructive Phoenix Force - is back on Earth; they decide to hold her accountable for the heinous acts of Dark Phoenix! Now; it\'s up to the spacefaring Guardians of the Galaxy to help the All-New X-Men save Jean from twisted intergalactic justice! A surprise ally from one character\'s past comes to help; but is that enough against the most powerful army in the Universe? You won\'t want to miss the first encounter between two of the biggest franchises in the Marvel universe! Collecting GUARDIANS OF THE GALAXY (2013) #11-13 and ALL-NEW X-MEN #22-24.'),
(3186, 3186, 'The Iron Avenger returns for another round of Marvelous Masterworks Mayhem; and this one\'s gonna go straight down to the final bell; True Believer! So buckle up your red and gold retrorockets and get ready for adventure a\'plenty as only Marvel can make it!\\r<br>Stan \\The Man\\\" and the Dynamo of Delineation'),
(3187, 3187, '- With the world on the brink of viral apocalypse; Logan and Kitty Pryde face down the Thirteen Ninjas of Sabretooth\'s Hand!\\n- And that\'s not all - enter Lord Deathstrike and the Silver Samurai!\\n- It all comes to a head with one final moment that will change the face of Wolverine - forever!'),
(3188, 3188, 'Heist on the moon! With Tony now aware of Phlogistone\\u2019s deadly properties; to what lengths will he go to stop the spread of the new element? And what exactly is Cortex Incorporated hiding from Tony?'),
(3189, 3189, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3190, 3190, 'THE CAROL CORPS ISSUE!\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<ul><li>THE special oversized issue to end all oversized issues!</li><li>In the aftermath of Enemy Within; Carol Danvers must rebuild her memories through the eyes of her biggest fan.</li><li>Find out why this is such a fan-beloved series!</li></ul>'),
(3191, 3191, 'Bunnies! Lots of bunnies! Including a King Bunny who doesn&#39;t want to be a king.\\nBabies! Babies in mortal danger! Including one baby almost crushed beneath the wheels of Ozma&#39;s Red Wagon and another baby nearly torn to pieces by tigers and bears. Well; sort of.\\nThen Ozma discovers the Nome Army&#39;s impending invasion of Oz. Is Ozma too late to save her land from annihilation?'),
(3192, 3192, 'Spider-Man&#39;s got 99 problems...and a race against time is one of them!\\nSpider-Man finds himself thousands of miles above the planet; fighting for his life against some of his greatest foe\\nMarvel Knights&#39; Matt Kindt and Marco Rudy bring you the Wall-Crawler you love as you&#39;ve never seen him before!'),
(3193, 3193, '<ul><li>Fantomex finds himself at the bottom of the ocean&hellip; in Antarctica?</li><li>Vicious villains; kidnapping; and the end of the world.</li><li>Then; someone releases the Kraken!</li></ul>'),
(3194, 3194, 'The must-read; sleeper-hit book of 2012! Clint Barton - a.k.a. the self-made hero Hawkeye; breakout star of the Avengers film; fights for justice...and good rooftop BBQs! And with Young Avenger Kate Bishop by his side; it\'s double the Hawkeye and double the trouble as they battle Superstorm Sandy; digital doomsday; dog detectives; lady problems; murder for money; tracksuited killers and more! It\'s cars; guns and videotape as Matt Fraction and David Aja (IMMORTAL IRON FIST) reunite for this exciting; adventurous reinvention of the arrowed Avenger! Plus: Relive Kate\'s first meeting with Clint as she learns wanting something can be miles away from actually earning it. And most important; Pizza Dog gets his own story! Can he solve the grisly murder that shocked Team Hawkguy? Who knows! He\'s a dog! Collecting HAWKEYE (2012) #1-11 and YOUNG AVENGERS PRESENTS #6.'),
(3195, 3195, 'After decades of malevolent misdeeds and vile villainy; could the Mad Titan be attempting to redeem himself? Scorned by his paramour Death and changed by his recent battles with the universe\'s cosmic powers; Thanos may have just decided to turn over a new leaf. But to make good on his vow; he must face the world devourer Galactus; the all-consuming universal Hunger; the unimaginably powerful Beyonder and the unknown threat of the Fallen One! Most of the universe doubts Thanos\' sincerity; but a handful of uneasy allies support him: Adam Warlock; Pip the Troll; Gladiator and Star-Lord. Witness Thanos\' cosmic struggle for repentance - but ask yourself; what dire fate awaits the universe if he fails? Collecting THANOS #1-12.'),
(3196, 3196, 'Roll up your jacket sleeves; and dust off your Rubik\'s Cube as Marvel heads back to the eighties! From Alpha Flight to Zabu; heroes old and new grab the spotlight in their own titles in this first classic collection of the decade\'s most dazzling debuts! All your favorites are here - including Dominic Fortune; Captain Universe and the New Mutants - plus Marvel\'s first \\event\\\" miniseries! Collecting material from HULK (1978) #21'),
(3197, 3197, 'Frank Miller\'s spellbinding scripts and pulse-pounding pencils herald one of Daredevil\'s greatest eras; just in time for the Kingpin and Bullseye\'s efforts to rob the Man Without Fear of everything he holds dear! Featuring the first appearances of Elektra; Stick and the Hand! The daring discovery that drew Ben Urich into Daredevil\'s domain of darkness! And such forgotten-yet-formidable foes as Death-Stalker and the Gladiator! Guest-starring the Hulk; the Avengers; and Power Man and Iron Fist! Collecting DAREDEVIL (1964) #158-161 and #163-191; and material from WHAT IF? (1977) #28.'),
(3198, 3198, 'An AMAZING new era for the X-Men starts here! Ever since his Nightcrawler&#39;s death in X-MEN MESSIAH COMPLEX; the X-Men have been without their heart and soul. After learning that their friend may not be gone after all; it&#39;s up to WOLVERINE; STORM; BEAST; ICEMAN; NORTHSTAR and FIRESTAR to find and bring back the fan favorite fuzzy blue elf! Super star artist ED MCGUINNESS (HULK) joins master X-Writer JASON AARON (WOLVERINE AND THE X-MEN; X-MEN: SCHISM) to bring you the most exciting comic on the stands!'),
(3199, 3199, 'PAINKILLER JANE is back in action as we follow her on an adrenaline filled adventure protecting a Saudi Arabian princess on her visit to the New York City. It seems a number of people want her dead and the only thing between them and her royal highness is our gun toting; out of control; Painkiller Jane. Also in this issue a 10 page back up telling you all about the origin of Painkiller Jane and her friendship between her best friend Detective Maureen Fernandez.'),
(3200, 3200, '- Travel back to the deadly days of World War II as the globe stands on the edge of destruction...and one skinny kid from Brooklyn steps forward to become the Strategic Scientific Reserve\'s one and only Super-Soldier!\\n- Captain America! Bucky! The Howling Commandos! The Red Skull! All of this and more movie magic!'),
(3201, 3201, 'The Blue Marvel joins the fight - and the Ebony Maw makes his move!\\nA plague of demons is raging through Manhattan; and the only Avenger who can defeat them is... Spider Hero? What?\\nSeriously; who is that guy?'),
(3202, 3202, '- AGE OF ULTRON ripped a hole into the Ultimate Universe\\n- GALACTUS came through...hungry\\n- Is this the last stand of the Ultimate heroes?'),
(3203, 3203, 'Hulk&#39;s family of smashers continues to grow; as does the property damage!\\nBased on the hit DISNEY XD animated show.'),
(3204, 3204, 'The Blue Marvel joins the fight - and the Ebony Maw makes his move!\\nA plague of demons is raging through Manhattan; and the only Avenger who can defeat them is... Spider Hero? What?\\nSeriously; who is that guy?'),
(3205, 3205, 'THE CAROL CORPS ISSUE!\\r\\n\\r\\n\\r\\n\\r\\n\\r\\n<ul><li>THE special oversized issue to end all oversized issues!</li><li>In the aftermath of Enemy Within; Carol Danvers must rebuild her memories through the eyes of her biggest fan.</li><li>Find out why this is such a fan-beloved series!</li></ul>'),
(3206, 3206, 'TONY STARK has returned from space with a vision of a better world.\\nWho is his secret ally? What is his secret resource? Who on Earth would stop him?\\nThe MANDARIN is dead. He died at the end of Fraction&#39;s run. There&#39;s probably a reason why we&#39;re mentioning it.'),
(3207, 3207, 'Tony Stark is Iron Man - technological visionary; wealthy playboy; unparalleled engineer and armored Avenger. But NOW!; his greatest invention has just become his greatest mistake: The lethal techno-virus Extremis is out in the wild! Tony\'s hunt for the rogue Extremis Units takes him to New Camelot; where he clashes with the mech-knights called the Circle and dogfights the Russian Black Exoskeleton Academy; to Colombia; where he battles old foes Vibro; Firebrand and the Living Laser; and to the ancient catacombs of Paris; where absolute horror awaits - and Tony may have to betray an old friend! Introducing Iron Man\'s stealth armor; heavy-duty battle-suit and space armor as Tony creates new suits to tackle new challenges! If he wants to save the world from his own deadly nano-virus; Iron Man must act fast - and Tony Stark must build faster! Collecting IRON MAN (2012) #1-5.'),
(3208, 3208, 'It\'s the beginning of a new era for Iron Man! Renowned scribe Warren Ellis joins forces with acclaimed illustrator Adi Granov to redefine the armored Avenger\'s world for the 21st century - a landscape of terrifying new technologies that threaten to overwhelm a fragile mankind! What is Extremis? Who has unleashed it? What does its emergence portend for the world? And how will it change Iron Man\'s life - forever?! Collecting IRON MAN (2005) #1-6.'),
(3209, 3209, 'An all-new original graphic novel; modernizing the formative first days of this super-hero icon that defined pop culture! Billionaire weapons manufacturer Tony Stark lived a life of wealth and privilege. That all changed when an on-site visit to a war-torn nation went horribly wrong; leaving Tony gravely injured in the hands of dangerous extremists - one a former friend. When asked to build a weapon; Tony instead constructed a mechanized suit of armor and escaped. But the horrors he left behind are coming for retribution; and the only way to stop them is for the carefree playboy to become the Iron Man!'),
(3210, 3210, '\\Troubled Mind\\\" Part 1\\n- An Avenger no more?\\n- With the public at large realizing this is no longer a \\\"Friendly Neighborhood\\\" Spider-Man'),
(3211, 3211, '&ldquo;NATURAL RESOURCES&rdquo; CONTINUES!\\r\\n\\r\\n\\r\\n\\r\\n<ul><li>Utopia thrives; but at what cost?</li><li>Mach Two&rsquo;s jungle insurgency</li><li>Eyes In The Sky - who&rsquo;s watching the mutants?</li></ul>'),
(3212, 3212, '<ul><li>It&rsquo;s Venom vs. Toxin in the schoolyard!</li><li>But have these two symbiote-psychos created something far more evil in Philadelphia?!</li></ul>'),
(3213, 3213, '<ul><li>Writer Jason Latour (Loose Ends; Wolverine) and artist Nic Klein (Dancer; Viking; Doc Savage) begin the third explosive chapter of THE WINTER SOLDIER&rsquo;S newest deadly mission.</li><li>S.H.I.E.L.D. is crippled; the world is on it&rsquo;s knees and the only thing that stands in the way of THE ELECTRIC GHOST&rsquo;S devastating master plan is Bucky Barnes!</li><li>But how can Bucky act when the cost of winning this battle may just be the loss of his own future?</li></ul>'),
(3214, 3214, '<ul><li>Writer Jason Latour (Loose Ends; Wolverine) and artist Nic Klein (Dancer; Viking; Doc Savage) begin the third explosive chapter of THE WINTER SOLDIER&rsquo;S newest deadly mission.</li><li>S.H.I.E.L.D. is crippled; the world is on it&rsquo;s knees and the only thing that stands in the way of THE ELECTRIC GHOST&rsquo;S devastating master plan is Bucky Barnes!</li><li>But how can Bucky act when the cost of winning this battle may just be the loss of his own future?</li></ul>'),
(3215, 3215, '- What comes after \\Marvel NOW!\\\"? Whatever it is'),
(3216, 3216, '<ul><li>The impossible has happened!</li><li>The Earth has been taken by Ultron&hellip;what few super hero survivors there are try desperately to stay alive.</li><li>And it is Luke Cage who discovers the secret behind Ultron&rsquo;s victory over all of mankind.</li><li>A secret that will have fans of Marvel comics arguing for years to come!</li></ul>'),
(3217, 3217, 'PART 3 of X-TERMINATION! &ndash; FINAL ISSUE!\\r\\n\\r\\n\\r\\n<ul><li>The multi-verse is being consumed!</li><li>No one is safe as our heroes split up to fight a war in two universes.</li></ul>'),
(3218, 3218, '<ul><li>The Uncanny X-Men come to the Jean Grey School to recruit.</li><li>Who will join Cyclops and his revolutionary crew? The answer will shock you!</li><li>Mystique and Sabretooth continue to hatch their master plan and it doesn&rsquo;t bode well for the All-New X-Men.</li></ul>'),
(3219, 3219, '<ul><li>First&hellip;flashback to Deadpool&rsquo;s adventures in yesteryear with Iron Man!</li><li>Then&hellip;Deadpool is hired by a demon to reclaim damned souls!</li><li>Plus&hellip;Wade gets in touch with his feminine side!</li></ul>'),
(3220, 3220, '- What comes after \\Marvel NOW!\\\"? Whatever it is'),
(3221, 3221, 'The Guardians of the Galaxy take off for the stars in this ground-breaking Infinite comic re-introducing the Guardians to the Marvel Universe.'),
(3222, 3222, 'ROUTE 616 CONTINUES!\\r\\n\\r\\n\\r\\n\\r\\n<ul><li>Red She-Hulk goes deep underground to find the secrets of the ancient order of the Shield!</li><li>There&rsquo;s a new ruler of the world below!</li><li>He may never let her leave&hellip;</li></ul>'),
(3223, 3223, 'PART 3 of X-TERMINATION! &ndash; FINAL ISSUE!\\r\\n\\r\\n\\r\\n<ul><li>The multi-verse is being consumed!</li><li>No one is safe as our heroes split up to fight a war in two universes.</li></ul>'),
(3224, 3224, '...but will soon change the very nature of the Marvel Universe.\\r\\n<ul><li>What comes after &ldquo;Marvel NOW!&rdquo;? Whatever it is; it starts HERE.</li><li>The vile face left movie audiences in shock after last summer&rsquo;s Marvel Studios&rsquo; &ldquo;The Avengers&rdquo; movie; but who is this eerily disturbing villain?</li><li>Thanos rises as the unrivaled rogue of wretchedness in this gripping tale of tragedy; deceit and destiny. Where did this demi-god of death and destruction come from and...more importantly what does he want?</li><li>The answers come from the incredible creative team of Jason Aaron (Wolverine; X-Men Origins) and Simone Bianchi (Wolverine; Astonishing X-Men) as they take you on journey that will not only change the course of one boy&rsquo;s life...</li></ul>'),
(3225, 3225, '- What comes after \\Marvel NOW!\\\"? Whatever it is'),
(3226, 3226, 'Walt Simonson draws the Hulk AND Thor!\\r\\n\\r\\n\\r\\n\\r\\n<ul><li>Banner takes his lab team to Jotunheim!</li><li>Hulk vs. Frost Giants!</li><li>Guest-starring Thor!</li></ul>'),
(3227, 3227, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3228, 3228, '<ul><li>Acclaimed crime novelist and Edgar Award winner MEGAN ABBOTT (Queenpin; The End of Everything) takes on the Punisher!</li></ul>'),
(3229, 3229, '- Join us for a once in a lifetime event: the one; true 50th Anniversary Issue of the Amazing Spider-Man.\\n- A special over-sized issue harkening back to the legend the legend that started it all!  Get ready for an all-new tale about a different kind of power and responsibility...\\n- Plus original stories by Dean Haspiel; Joshua Hale Fialkov & Nuno Plati!'),
(3230, 3230, '- Join us for a once in a lifetime event: the one; true 50th Anniversary Issue of the Amazing Spider-Man.\\n- A special over-sized issue harkening back to the legend the legend that started it all!  Get ready for an all-new tale about a different kind of power and responsibility...\\n- Plus original stories by Dean Haspiel; Joshua Hale Fialkov & Nuno Plati!'),
(3231, 3231, '- Join us for a once in a lifetime event: the one; true 50th Anniversary Issue of the Amazing Spider-Man.\\n- A special over-sized issue harkening back to the legend the legend that started it all!  Get ready for an all-new tale about a different kind of power and responsibility...\\n- Plus original stories by Dean Haspiel; Joshua Hale Fialkov & Nuno Plati!'),
(3232, 3232, '- Join us for a once in a lifetime event: the one; true 50th Anniversary Issue of the Amazing Spider-Man.\\n- A special over-sized issue harkening back to the legend the legend that started it all!  Get ready for an all-new tale about a different kind of power and responsibility...\\n- Plus original stories by Dean Haspiel; Joshua Hale Fialkov & Nuno Plati!'),
(3233, 3233, '- Join us for a once in a lifetime event: the one; true 50th Anniversary Issue of the Amazing Spider-Man.\\n- A special over-sized issue harkening back to the legend the legend that started it all!  Get ready for an all-new tale about a different kind of power and responsibility...\\n- Plus original stories by Dean Haspiel; Joshua Hale Fialkov & Nuno Plati!'),
(3234, 3234, '<ul><li>Sabretooth is back &ndash; but which one is the real one?</li><li>Where has Sabretooth been and whose side is he on this time?</li><li>The identity of the red-headed woman who came to Wolverine&rsquo;s rescue is revealed!</li></ul>'),
(3235, 3235, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3236, 3236, 'Witness the future of comics in this digital tie-in to Avengers vs. X-Men! With the Avengers hopes of victory at their bleakest; Iron Man; Beast and the Scarlet Witch strategize and run simulations to see if there is any way they can take out Phoenix-powered X-Men.'),
(3237, 3237, '- \\No Turning Back\\\" comes to an epic conclusion as only one man on Earth has a chance of helping Spider-Man stop the Lizard.  And his name is Curt Connors.\\n- Plus a shocking development that will set things in motion... for AMAZING SPIDER-MAN #700!\\n- Be sure to pick this issue up fast'),
(3238, 3238, '<ul><li>The first of five issues that will CHANGE THE FACE OF X-FACTOR FOREVER.</li><li>PART I: A rejected Strong Guy does the unthinkable!</li><li>PART II: Two characters you never thought would come face-to-face are finally reunited.</li></ul>'),
(3239, 3239, '- Part two of \\Blacklisted!\\\"\\n- The return of classic Deadpool Detractor');
INSERT INTO `descripcion_comics` (`id_descripcion`, `id_comic`, `descripcion_comics`) VALUES
(3240, 3240, '- AvX fall-out: Avengers Academy is closed...indefinitely!\\n- Alchemist; a.k.a. wunderkind industrialist Jeremy Briggs; offers the students a chance to \\nbe normal again! But is there a catch? And who will accept his deal?\\n- Years of plot threads explode as your favorite Avengers Academy characters face their \\nultimate challenges in parts 1 & 2 of \\Final Exam\\\"!\"'),
(3241, 3241, '- The Avengers versus the unbelievable might of the X-Men!\\n- The special issue of Avengers is the flip side to Wolverine and the X-Men #12. \\n- Witness a very surprising tie-in experience like you\'ve never seen before!'),
(3242, 3242, '- It\'s all built to this: \\Final Execution\\\" enters its last act!\\n- The new Brotherhood of Evil Mutants makes their move!\\n- Fantomex\'s deceptions come back to haunt the team!\"'),
(3243, 3243, '- The return of someone Matt thought was gone forever!\\n- The debut of a new menace in New York - the killer called Coyote!\\n- And just how sane IS Matt Murdock?\\n- The Eisner nominated creative team is reunited as Paolo Rivera returns!'),
(3244, 3244, '- THE PENULTIMATE CHAPTER OF MAYAN RULE!!!\\n- Guest starring ALPHA FLIGHT and MACHINE MAN\\n- The MAYAN GODS continue to remake Earth in their own image!\\n- Will RED HULK\'S power be used to end the world?\\n- Guest starring ALPHA FLIGHT; MACHINE MAN and the SHE-HULKS!'),
(3245, 3245, '<ul><li>The Hellions return in &ldquo;Fear The Future&rdquo; part 1!</li><li>The New Mutants thought they&rsquo;d defeated their most unexpected foe; but they will soon learn that while you can change the future; but you can never escape it!</li><li>The shocking story that (yeah; we&rsquo;re saying it) will change the New Mutants as you know them!</li></ul>'),
(3246, 3246, 'THE DARK AVENGERS AND THE THUNDERBOLTS ARE ON A COLLISION COURSE - THROUGH TIME!\\n- Can history\'s most Wanted villains save Luke Cage from his future?!\\n- Jeff Parker; Declan Shalvey and Kev Walker unite for an epic tale of one man\'s destiny!'),
(3247, 3247, 'Nature Girl\'s crusade to clean up the Earth continues in part 2 of \\X-Men: Green.\\\"\"'),
(3248, 3248, 'Giant-Size Little Marvels Presents \\Game Night Part 2\\\"!\"'),
(3249, 3249, '\\Scourge of the Seven Seas\\\"\\u2014Jeff the Land Shark goes deep-sea diving.\"'),
(3250, 3250, 'There\'s no reserve at his auction! Tony Stark and Reed Richard\'s inventions are up for grabs at a villain-only auction and... there\'s a lot of grabbing. When the hard drive with all the goodies gets spirited away; Sue Storm must (very very reluctantly) team-up with Deadpool to get it back.'),
