(3778, 3778, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3779, 3779, 'JEDI KNIGHT AND PRIVATE EYE TEAM UP TO UNCOVER A MYSTERY THAT WILL CHANGE THE HIGH REPUBLIC FOREVER! A Jedi Master is dead. Another is in a state of complete shock. It\'s a murder the likes of which the Jedi Order has never seen before. There are no leads. There are no suspects. There is no motive. But Jedi Investigator EMERICK CAPHTOR must solve the case before it\'s too late. The fate of the Jedi; the Hutts; the Nihil and everyone in the galaxy; hangs by this tangled thread of lies and deceit. Emerick will need to dive into the darkness; testing himself and his Jedi ideals like never before. He\'ll need help. Luckily; Private Eye SIAN HOLT lives in the dark. Together; they\'ll follow this trail of shadows wherever it leads. If they can work together; that is.'),
