(3831, 3831, 'On a humanitarian mission; the Black Panther finds himself under attack by the aquatic villain Tiger Shark!'),
(3832, 3832, 'The chase begins! White Rabbit sets fire to Central Park to get Spider-Man\\u2019s attention. But where will she lead him?'),
(3833, 3833, 'When Hope Summers finds herself paralyzed by terrors and trepidations not her own; she\\u2019ll have to recruit Dani Moonstar to help her get to the bottom of her newfound dread before it can consume her. Sometimes the only way to conquer your fear is to face it head on.'),
(3834, 3834, 'No tiene descripcion. Prueba de nuevo dentro de varios dias'),
(3835, 3835, 'The arrival of a surprise guest at his wedding turns Wolverine\\u2019s world upside-down!'),
(3836, 3836, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #1! Spinning out of the KING IN BLACK epic comes a dark; chilling story of the birth of Atlantis\\u2019s greatest villains. The players: Namor; Lady Dorma of Atlantis; the outsider Attuma\\u2014all still in their teen years \\u2014 and The Swift Riders; the Atlantean Empire\\u2019s greatest heroes. '),
(3837, 3837, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #1! It begins with alliances and possibility; as Attuma\\u2019s people may join the Empire\\u2026but what lies ahead is tragedy; betrayal; and the unleashing of dangerous; deadly magics. A deep dive into Marvel history\\u2026and the birth of a threat that will only grow in menace across time.'),
(3838, 3838, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #2! The Young Namor; Attuma; and Dorma get to accompany the Swift Riders on a mission; see them in action and learn from them. But the mission involves Russian alchemists in 1930s Murmansk; a dangerous mystic relic; and a catastrophe that brings to life the most menacing threat that Atlantis has ever faced.'),
(3839, 3839, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #2! All of undersea civilization is imperiled; and only three youngsters\\u2014Namor; Attuma; and Dorma\\u2014can save it!'),
(3840, 3840, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #3! The Black Tide lay waste to all that lies before them; cutting a swath of devastation and death across the ocean floor. The only chance to stop them may lie with Attuma\\u2019s people\\u2014and if that fails; nothing stands between The Black Tide and Atlantis itself.'),
(3841, 3841, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #3! A tragedy that will impact Atlantean history forever; and transform friendship into enmity. The secrets of the King in Black are buried here.'),
(3842, 3842, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #4! The Black Tide\\u2019s wave of devastation now threatens Atlantis itself. Namor; Dorma and Attuma may be the undersea world\\u2019s only hope; but unless they can shake off their utter defeat from last issue; they don\\u2019t even stand a chance. '),
(3843, 3843, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #4! The one possible weapon that Namor; Dorma; and Attuma could wield against the Black Tide is in Murmansk; thousands of miles away. It\\u2019s Atlantis\\u2019s darkest hour\\u2026'),
(3844, 3844, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #5! As the Dark Tide threatens Atlantis; Namor; Attuma and Dorma make a desperate; dangerous attempt to save the undersea world\\u2014but even if they can manage it; it\\u2019ll come at a great cost.'),
(3845, 3845, 'The Infinity Comics adaptation of KING IN BLACK: NAMOR #5! The grand finale! Learn the fate of Atlantis\\u2014of Attuma\\u2014of the Dark Tide\\u2014and the future of the Dark Tide as well. What will come out of the King in Black for Namor and Atlantis? Watch it unfold here.'),
