(4260, 4260, 'Collects Miles Morales: Spider-Man (2018) #33-36; material from Miles Morales: Spider-Man Annual (2021) #1.  What lies Beyond for Miles Morales? Momentous events in the world of Peter Parker are about to have dire repercussions for both Miles and his meta_x0002_morphic clone; Shift! But what does this domino effect of events mean for Ben Reilly; the new corporate-sponsored Spider-Man? Miles and Shift must descend into the darkness of the Assessor\'s HQ for answers - and when Space Stone-host Quantum enters the fray; the heroes\' only hope might just be the Beyond Corporation! Plus: As Miles investigates a series of monster attacks in Brooklyn; he runs into Ms. Marvel\'s friend and ally; Amulet! Working together; can they get to the bottom of this mystery before the monsters take them down too?'),
