(4314, 4314, 'Collects Truth: Red; White & Black (2002) #1-7.  In every war; there are legends. And World War II birthed Captain America; the heroic Sentinel of Liberty. But in this shocking re-examination of the 1940s Super-Soldier program; a hidden and controversial chapter of history is declassified at last! Meet the unit of African-American soldiers who were involuntarily subjected to the U.S. War Department\'s brutish efforts to refine the Super-Soldier Serum. And hear the story of Isaiah Bradley; who overcame all odds to don the famous red-white-and-blue on the battlefield! Robert Morales and Kyle Baker hit home with a touching; timely and thought-provoking tale that spans decades!'),
