(4355, 4355, 'Collects Daredevil (1964) #87-107; Avengers (1963) #111.  If you\'re going to San Francisco; be sure to wear some horns on your head! Daredevil and the Black Widow ditch New York City and head out West to get some peace; love and appreciation. No; scratch that: They\'ll face new challenges and classic villains alike - including Electro; Killgrave the Purple Man and Mister Fear - all courtesy of Gerry Conway and the unmatched art team of Gene Colan and Tom Palmer! Then; Steve Gerber introduces adversaries weirder than anything on Haight-Ashbury. The Dark Messiah and Angar the Screamer lead the charge; until Stilt-Man struts his way across the Golden Gate! It\'s all topped off with a crossover co-starring the Avengers and X-Men; a Spidey team-up and a fight with Kraven the Hunter that soon turns decidedly cosmic!'),
