(5302, 5302, 'Collects Ms. Marvel (2015) #19-24. The malleable Ms. Marvel continues her hero\'s journey as an enemy from her past begins targeting those closest to her - a challenge that calls into question everything about her. Not just as a super hero; but as a human being! Who can Ms. Marvel trust when everyone in Jersey City is against her? As Kamala\'s life hangs in the balance; a new crimefighter moves in on her turf. Will Ms. Marvel welcome the help - or will her nose be pushed out of joint? Things get tough for the shape-shifting; size-swapping sensation! Plus: Bruno may be far away at a prestigious school in Wakanda; but even thousands of miles from his former best friend; Kamala Khan; adventure still finds him!'),
(5303, 5303, 'Iron Man; War Machine; and Ironheart involve themselves in the ongoing Kaiju War.'),
(5304, 5304, 'Mecha D.O.O.M is still threatening the lives of Peni and everyone she loves. Can Peni defeat him without exposing her secret identity? And who is the Popcorn Knight? Stay tuned! '),
(5305, 5305, 'The Secret X-Men try to save Gorgon before it\'s too late! Will Hydra party crashers derail this year\'s Hellfire Gala?'),
(5306, 5306, 'Chef Anna Ameyama isn\\u2019t a big fan of Iron Man after his crash landing destroyed her food truck. But at least he offered her a job\\u2026sort of. If she can teach a knife-wielding robot to cook; make the best meal of her life; and impress one of Marvel\\u2019s most refined palates; she just might land the culinary adventure of her dreams. Featuring a mouth-watering recipe for you to try at home!'),
(5307, 5307, 'Step Two in winning the public\'s favor! Ziggy Pig disguises himself as Spider-Ham. What could possibly go wrong?'),
(5308, 5308, 'All-new story arc starts here! Millie Collins\\u2019 ultra-glamorous; jet-setting lifestyle is the perfect cover for S.H.I.E.L.D.\\u2019s most recent recruit! But when she butts heads with her new partner; sparks fly in an adventure featuring one of Marvel\\u2019s most iconic romantic heroines.'),
