(5318, 5318, 'A new super-team delivers justice like lightning as we celebrate the legacy of the House of Ideas with MARVEL TALES! This anthology series shines a spotlight on fan-favorite characters; features timeless stories and highlights some of Marvel\\u2019s most impressive talent from the past eight decades. In the wake of tragedy; the Thunderbolts rise to defend a shaken populace \\u2014 but what is the team\\u2019s shocking secret? Meet Atlas; Mach-1; Meteorite; Songbird; Techno and their leader; Citizen V; as they battle the Wrecking Crew and the Circus of Crime in THUNDERBOLTS (1997) #1-2 \\u2014 courtesy of legendary creators Kurt Busiek and Mark Bagley! The T-Bolts tackle a rampaging Hulk in INCREDIBLE HULK (1968) #449; and their legend spreads in TALES OF THE MARVEL UNIVERSE #1 \\u2014 but all is not what it seems! Prepare to relive the greatest trick Marvel Comics ever pulled!');
