(5389, 5389, 'Collects Way of X (2021) #1-5; X-Men: The Onslaught Revelation (2021) #1.  Only one mutant senses the looming shadows. On Krakoa; mutantkind has built a new Eden - but there are serpents in this garden. Some mutants struggle to fit in. Some mutants turn to violence and death. And the children whisper of the Patchwork Man; singing in their hearts. Snared by questions of death; law and love; only Nightcrawler can fight for the soul of Krakoa. Only he - and the curious crew he assembles - can help mutants defeat their inner darkness and find a new way to live! But the malevolent force hiding within Krakoa has begun to show its true form; and answers are hidden\\u2026within the Mindscape! What happens when the third law of Krakoa is broken? What happens when all other solutions have failed? What happens when Nightcrawler finally finds\\u2026the Way?'),
