(5536, 5536, 'Natasha Romanoff; the deadly Black Widow; showcases her highly particular set of skills as she is put to the test \\u2014 by S.H.I.E.L.D. itself! As the Widow takes on an army of armored agents; Nick Fury recounts Natasha\\u2019s incredible life \\u2014 from her origins as a Russian secret agent; to her change of heart and alliance with the Avengers! But all the while; Natasha is closing in on identifying the enemy \\u2014 and soon; she will be targeting S.H.I.E.L.D. for answers! Featuring some of the most sensational Black Widow art ever seen; by the legendary George P\\u00e9rez! Plus; A backup tale featuring Mowgli; star of The Jungle Book \\u2014 adapted from a tale by none other than Rudyard Kipling! It\\u2019s one of the all\\u2013time great Marvel comic books; boldly re\\u2013presented in its original form; ads and all! Reprinting MARVEL FANFARE (1982) #10.'),
