(6187, 6187, 'The Infinity Comics edition of ETERNALS (2006) #1! More than forty-five years ago; comics legend Jack Kirby returned to Marvel with perhaps his biggest idea of all: the Eternals! Their creation was the result of a ceaseless curiosity about man and his mythologies. Flash forward to 2006: Superstar creators Neil Gaiman and John Romita Jr. have taken on these concepts; telling a crackling yarn about the modern-day reawakening of these godlike heroes.'),
(6188, 6188, 'The Infinity Comics edition of ETERNALS (2006) #1! Ike Harris has dreams of adventures; love affairs and betrayals; but no one involved remembers or believes him. And who is trying to kill him to keep him from talking about it?'),
