(6204, 6204, 'Collects Iron Man (1968) #129-144.  The Marvel Masterworks continue David Michelinie and Bob Layton\\u2019s timeless IRON MAN run! Tony Stark recovers from his problems with the bottle by throwing himself into globetrotting business (and pleasure); but his enemies aren\\u2019t giving him an edge: The All-Devourer awaits in Hong Kong; the Titanium Man is ready to tango in Times Square and Force makes his brutal debut in the Bahamas! But sometimes it\\u2019s your friends you need to worry about the most: Can Stark beat back a hostile takeover of his company by Nick Fury and S.H.I.E.L.D.? With rich characterizations; a vibrant supporting cast and a steady stream of new armor designs; Michelinie and Layton prove they\\u2019re just getting started!'),
