(6206, 6206, 'Collects Conan the Avenger (2014) #1-19.  Four savage tales of Conan! When a case of mistaken identity leaves him accused of sorcery; the Cimmerian finds himself the target of a powerful and deadly witch hunter \\u2014 but what is the true evil that stalks the shadows of Kush? A quest for legendary treasure brings Conan and his comrades into battle with an army of brigands and more; but is the prize at stake worth the price to be paid? Cast into the desert and dying of thirst; Conan and the former slave Natala arrive in Xuthal \\u2014 the city of eternal dreamers \\u2014 where a mysterious horror lurks! And a call for help from a mysterious lighthouse beckons to Conan amidst the scorching sands. But he realizes too late that he\\u2019s stumbled into a trap; for this is an oasis of blood'),
